INSERT INTO `products` (`id`, `categoryId`, `categoryIdLv2`, `name`, `SKU`, `images`, `desc`, `technicalPrice`, `price`, `promotionPrice`, `quantity`, `sold`, `created_at`, `updated_at`, `meta_desc`, `meta_keywords`, `title`, `meta_title`) VALUES
(79, 3, '32', 'Bàn phím số R8', '10', '/assets/uploads/products/1616030980_sub_10.unnamed.png', '<ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:11pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím số R8 1810&nbsp; </span><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">là một thiết bị phụ kiện laptop không còn xa lạ với nhiều người, đặc biệt là với những người dùng làm các công việc liên quan tới các con số như kế toán, kiểm toán, thống kế…. Thông thường, thiết kế của một máy tính laptop, để có được kiểu dáng nhỏ gọn nhất phù hợp với yêu cầu đi lại của khách hàng, các nhà sản xuất laptop&nbsp; sẽ tối giản hết mức có thể những tính năng không quan trọng. Trong đó, bàn phím laptop cũng được lược bỏ phần ký tự số bên phải. Tuy nhiên, đối với nhiều người dùng làm các công việc liên quan nhiều tới việc tính toán thì đó sẽ là một khó khăn. Bởi việc sử dụng các ký tự số lẫn với ký tự chữ như ở trên laptop đôi khi sẽ dễ xảy ra nhầm lẫn và thao tác sẽ không được nhanh, ảnh hưởng tới tiến độ công việc.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:0pt;margin-bottom:11pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím số R8-1810</span><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">có thiết kế khá nhỏ gọn với kích thước 12*8*2cm(D*R*C) không chiếm nhiều diện tích và không gian làm việc của bạn. Ấn tượng đầu tiên của R8-1810 đó là vẻ ngoài chắc chắn và sang trọng của một sản phẩm cao cấp,Kiểu dáng thiết kế hình chữ nhật đơn giản với màu đen lịch sự khá thu hút người dùng ngay từ cái nhìn đầu tiên</span></p></li></ul><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:4pt;margin-bottom:9pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">&nbsp;</span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:11pt;margin-bottom:11pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím số R8-1810</span><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">– Vỏ được làm bằng chất liệu nhựa cao cấp có độ bền cao, có khả năng chống va đập. Các phím số được thiết kế với khoảng cách tiêu chuẩn. Các ký tự trên phím rõ ràng sắc nét và được phủ 1 lớp sơn bóng để tránh bị mờ các ký tự khi sử dụng trong thời gian dài sau này. Các phím đánh và êm và nhạy không xảy ra hiện tượng kẹt phím như ở một số dòng bàn phim số khác, cho bạn các thao tác chuẩn xác và nhanh chóng để phục vụ công việc</span></p></li></ul><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:4pt;margin-bottom:9pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">&nbsp;</span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:11pt;margin-bottom:11pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím số cho laptop loại tốt Sản phẩm còn có một đặc điểm nổi bật so với các dòng phím số giá rẻ khác. Đó là R8-1810 còn được tích hợp thêm 4 phím nóng (4 phím chức năng) là trang chủ (Home), Phím Tab (Tab), Email, Máy tính cho bạn thao tác nhanh chóng và thuận tiện hơn.</span></p></li></ul><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:4pt;margin-bottom:9pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">&nbsp;</span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:11pt;margin-bottom:11pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím số laptop giá rẻ R8có đèn Led báo xanh khi hoạt động để người dùng dễ nhận biết. Sản phẩm kết nối qua cổng USB thông dụng có ở mọi loại máy tính laptop. Dây nối chắc chắn khó đứt với dộ dài 1.5m cho bạn dễ dàng di chuyển hơn.</span></p></li></ul><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:4pt;margin-bottom:9pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">&nbsp;</span></p><p><span id=\"docs-internal-guid-849a0693-7fff-478b-841c-89c131b4de27\"></span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:11pt;margin-bottom:11pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Được thiết kế với độ nghiêng 15 độ.Phía dưới đáy sản phẩm có đệm cao su để tăng độ ma sát, chống trơn trượt khi để sản phẩm và sử dụng trên mặt phẳng, tránh rơi vỡ làm hỏng sản phẩm</span></p></li></ul>', 110000, 120000, 110000, 10, 0, '2021-03-16 02:22:18', '2021-03-17 18:29:40', 'giá rẻ đà lạt.linh kiện phụ kiện PC .Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi)', 'giá rẻ đà lạt.linh kiện phụ kiện PC .Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi)', 'Bộ Bàn Phím số R8| MNSCenter.com', 'Bộ Bàn Phím số R8| MNSCenter.com'),
(80, 3, '32', 'Bàn Phím MINI MULTIMEDIA K1000', '10', '/assets/uploads/products/1616030829_sub_10.keyboard-mini-k1000-multimedia.png', '<p><span id=\"docs-internal-guid-bd6eab36-7fff-340b-bb13-622ba7eaf8da\"></span></p><ul style=\"margin-top:0;margin-bottom:0;padding-inline-start:48px;\"><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:11pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn Phím Có Dây Bosston Mini Multimedia K1000 Với thiết kế nhỏ gọn tiện lợi, kích thước chỉ bằng kích cỡ bàn phím trên laptop 14 inch. Với ưu thế nhỏ gọn nên bạn có thể mang theo bất kỳ đâu mà không hề vướng víu.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím với thiết kế kiểu dáng mini multimedia, kết hợp các phím có độ bền đến 10 triệu lượt gõ, bạn có thể dùng được lâu dài so với nhiều bàn phím khác.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím có kích thước mỏng, kiểu dáng bắt mắt không chỉ giúp tiết kiệm được diện tích mà còn tạo tính thẩm mỹ cho không gian làm việc.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Ngoài ra, bạn còn có thể điều chỉnh chiều cao bằng cách gấp lại hoặc mở rộng đôi chân vững chắc để tăng độ nghiên của bàn phím thêm 8 độ.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Các phím bấm được bo tròn, các ký tự được in đậm với màu trắng sáng giúp cho người dùng dễ đọc hơn, hỗ trợ tối đa cho những người có tầm nhìn kém.</span></p></li><li dir=\"ltr\" style=\"list-style-type:disc;font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;\" aria-level=\"1\"><p dir=\"ltr\" style=\"line-height:1.38;background-color:#ffffff;margin-top:0pt;margin-bottom:11pt;\" role=\"presentation\"><span style=\"font-size:12.499999999999998pt;font-family:Roboto,sans-serif;color:#242424;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bàn phím được trang bị cổng kết nối USB 2.0 dễ dàng tương thích với các thiết bị máy tính như PC hay laptop giúp bạn thuận tiện hơn khi sử dụng.</span></p></li></ul>', 120000, 130000, 120000, 10, 0, '2021-03-16 02:30:15', '2021-03-17 18:27:09', 'K1000 .giá rẻ đà lạt.linh kiện phụ kiện PC . Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi)', 'K1000 .giá rẻ đà lạt.linh kiện phụ kiện PC . Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi)', 'Bộ Bàn Phím MINI MULTIMEDIA K1000| MNSCenter.com', 'Bộ Bàn Phím MINI MULTIMEDIA K1000| MNSCenter.com'),
