(90, 3, '32', 'Bàn phím cơ E-DRA EK387 Blue switch', '10', '/assets/uploads/products/1616312434_sub_10.29359_e_dra_ek387.jpg,/assets/uploads/products/1616312434_sub_10.29359_e-dra-ek3875.jpg,/assets/uploads/products/1616312434_sub_10.ban_phim_dc7b4956be4c4f7fa3f7c0401e7307eb_12046441a9ee4addaf3106b7b2470b06_master.png', '<h2 style=\"font-weight: 500; font-size: 2rem; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">E-DRA EK387 CÓ ĐỘ CHẮC CHẮN TUYỆT HẢO</span></h2><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">Đối với người dùng phổ thông và game thủ là học sinh sinh viên, thì chiếc&nbsp;<span style=\"font-weight: bolder;\"><span style=\"color: rgb(0, 0, 255);\"><a href=\"https://www.anphatpc.com.vn/ban-phim-co-gia-re_dm1494.html\" style=\"color: rgb(0, 0, 255); transition: all 0.3s ease 0s; outline-style: none; outline-width: initial;\">bàn phím cơ giá rẻ</a></span></span>&nbsp;đảm bảo được yếu tố về độ bền là điều được ưu tiên hàng đầu. Nắm bắt được nhu cầu đó, E-Dra đã cho ra đời chiếc phím EK387 với&nbsp;<span style=\"font-weight: bolder;\"><span style=\"color: rgb(255, 0, 0);\">chất lượng build tuyệt hảo. Về phần khung và vỏ phím, chúng tôi tin rằng trong phân khúc dưới 1 triệu hiện không có phím nào build tốt bằng EK387</span></span>&nbsp;(tốt hơn cả Fuhlen M87s). Phím với lớp nhựa cực dày, vân nhám cầm cực kỳ chắc tay, thiết kế vỏ phím cao che hết chân keycap theo phong cách cổ điển làm chúng ta liên tưởng tới IKBC.<br>Mặt sau phím cũng được quan tâm, gia cố chắc chắn và các chân phụ cùng các miếng chân cao su cũng được làm rất \"tử tế\", đây là điều hiếm có trong phân khúc giá này.<br><br><br></p><p style=\"text-align: center; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">&nbsp;<img src=\"https://mnscenter.com/assets/uploads/products/desc/1616062909_desc_img_1572855376013_o_1doqnoq491bsm8k571n1qj918b4d_9710fb6a0357492899e13848ce479dc5.jpg\"></p><h2 style=\"font-weight: 500; font-size: 2rem; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">BÀN PHÍM ĐƯỢC TRANG BỊ SWITCH HUANO&nbsp;SIÊU BỀN</span></h2><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">Ở phân khúc giá rẻ, E-Dra EK387 version 2021 với nâng cấp switch Huano cho cảm giác bấm tốt hơn và ổn định hơn. Theo công bố của nhà sản xuất,&nbsp;<span style=\"font-weight: bolder;\"><span style=\"color: rgb(255, 0, 0);\">switch này có độ bền tới 50 triệu lần bấm</span></span>.&nbsp;<span style=\"font-weight: bolder;\"><span style=\"color: rgb(255, 0, 0);\">Đặc biệt EK387 có đủ 3 phiên bản switch: Blue, Brown, Red</span></span>&nbsp;- một điều hiếm có mà trên thị trường hiện tại chỉ có DareU là có thể cung cấp đủ cả 3 loại switch cho phân khúc phím cơ giá rẻ.<br></p><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">Hệ thống Stabillizer mà bàn phím sử dụng theo kiểu \"Cherry\", kiểu stab này sẽ cho phép người dùng cực kỳ dễ thay thế keycap khi cần, và trên thực tế là phím sử dụng đúng layout và chân keycap chuẩn Cherry cực kỳ thông dụng. Thực tế trải nghiệm cũng tôi thấy Stab cho cảm giác gõ các phím dài tương đối tốt.<br><div style=\"text-align: center;\"><span style=\"font-size: 0.875rem;\">&nbsp;</span><img src=\"https://mnscenter.com/assets/uploads/products/desc/1616062927_desc_ban-phim-co-edra-ek387-pro-blue.jpg\" style=\"font-size: 0.875rem; float: none;\"></div></p><h2 style=\"font-weight: 500; font-size: 2rem; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">KEYCAP DOUBLE SHOT BỀN VÔ ĐỊCH</span></h2><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">Để đảm bảo tính \"ăn chắc mặc bền\", E-Dra EK387 được gắn bộ&nbsp;<span style=\"font-weight: bolder;\"><span style=\"color: rgb(255, 0, 0);\">keycaps double shot</span></span>&nbsp;bằng như ABS, và nhìn qua chúng giống hệt so với các bộ keycap được dùng trên các loại phím cơ khác như Fuhlen. Bộ keycap có font chữ không được đẹp nhưng rất bền và xuyên led tốt.<br><br></p><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\"></p><p style=\"text-align: center; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">&nbsp;<img src=\"https://mnscenter.com/assets/uploads/products/desc/1616062815_desc_ek.png\"></p><h2 style=\"font-weight: 500; font-size: 2rem; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">ĐÈN LED RAINBOW SIÊU SÁNG VÀ NHIỀU HIỆU ỨNG</span></h2><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">Xét về đèn LED, chúng tôi đánh giá rất cao về màu sắc và độ sáng của E-Dra EK387. Thực sự trong phân khúc này EK387 sáng hơn rất rất nhiều so với EK87 cảu DareU và ngang ngửa với Fuhlen M87s. Tất nhiên đèn trên phím chỉ là rainbow với 6 màu chia thành 6 vùng nhưng các hiệu ứng chuyển động màu rất uyển chuyển và đẹp mắt.<br><br><br></p><p style=\"text-align: center; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">&nbsp;<img src=\"https://mnscenter.com/assets/uploads/products/desc/1616062712_desc_ek.png\"></p><h2 style=\"font-weight: 500; font-size: 2rem; color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">CỰC KỲ ĐÁNG TIỀN</span></h2><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\">Chúng tôi đánh giá bàn phím E-Dra EK387 cực kỳ đáng giá, hội tụ đủ yếu tố để trở thành một trong những mẫu phím cơ giá rẻ tốt nhất năm 2019</p><p style=\"color: rgb(34, 34, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif;\"><img src=\"https://www.anphatpc.com.vn/media/lib/29359_e-dra-ek3875.jpg\" alt=\"E-Dra EK387\" width=\"800\" height=\"533\" style=\"max-width: 100%; height: auto; display: block; margin-left: auto; margin-right: auto;\"></p>', 650000, 710000, 650000, 10, 0, '2021-03-18 03:28:21', '2021-03-21 00:40:34', 'Bàn phím cơ E-DRA EK387 Huano Blue switch', 'MNS Center.com\r\nBàn phím cơ E-DRA EK387 Huano Blue switch \r\nBàn phím cơ E-DRA EK387 giá rẻ Đà Lạt', 'Bàn phím cơ E-DRA EK387 Huano Blue switch \r\nMNS Center.com', 'Bàn phím cơ E-DRA EK387 Huano Blue switch \r\nMNS Center.com'),
(92, 3, '31', 'Chuột máy tính văn phòng có dây E DRA EM601', 'PKC002', '/assets/uploads/products/1616639096_sub_PKC002.1.jpg', '<p class=\"MsoNormal\" align=\"left\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 20pt;\">Chuột gaming có\r\ndây&nbsp;E-Dra EM601</span><span style=\"font-size:20.0pt;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 12pt 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><a href=\"https://mega.com.vn/chuot-cac-hang-khac.html\" target=\"_blank\" title=\"Chuột gaming có dây E-DRA\"><span style=\"color: black;\">Chuột gaming có dây E-DRA</span></a>&nbsp;E-Dra\r\nEM601 là một trong những sản phẩm được thiết kế và sản xuất bởi E-Dra - thương\r\nhiệu chuyên sản xuất phụ kiện gaming được nhiều game thủ, người đam mê công\r\nnghệ ưa chuộng bởi thiết kế nhỏ gọn, kiểu dáng đẹp mắt, phù hợp với tất cả\r\nngười dùng.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 12pt 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Với\r\nđộ phân giải quang học lên tới 1000dpi, giúp con chuột này đạt được độ nhạy rất\r\ncao. Hơn nữa, con trỏ chuột di chuyển trơn tru trên màn hình cho bạn khả năng\r\nlàm chủ chuyển động chuột khi chơi các game FPS hay Moba.</p><p class=\"MsoNormal\" style=\"text-align: center; margin: 12pt 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><img src=\"https://mnscenter.com/assets/uploads/products/desc/1616065779_desc_2.jpg\"><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 12pt 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Nút\r\nchuột trái và phải nằm tách biệt với nhau, ngăn cách bởi nút lăn cho năng bấm\r\nchính xác, tránh bị kẹt nút, tăng độ nhạy khi dùng.<o:p></o:p></p><p class=\"MsoNormal\" style=\"margin: 12pt 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ngoài\r\nra, dây cáp dài 1.7m giúp người có thể sử dụng thoải mái và linh hoạt hơn.<o:p></o:p></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"mso-bidi-font-size:13.0pt;line-height:107%\">E-DRA\r\nEM601 là loại chuột gaming có thiết kế nhỏ gọn, kiểu dáng đẹp mắt, phù hợp với\r\ntất cả người dùng, là lựa chọn hàng đầu cho các game thủ trải nghiệm các tựa\r\ngame hàng đầu một cách tuyệt vời nhất.<o:p></o:p></span></p>', 80000, 120000, 90000, 20, 0, '2021-03-18 04:11:53', '2021-05-17 07:56:41', 'Chuột gaming có dây E-Dra EM601 chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột có dây, chuột gaming, linh kiện,', 'Chuột gaming có dây E-Dra EM601', 'Chuột gaming có dây E-Dra EM601');
