(107, 3, '31', 'Chuột không dây wireless VSP Q6', 'pkc003', '/assets/uploads/products/1616370606_sub_pkc003.2.jpg', '<p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Thiết\r\nkế vừa vặn<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột không dây wireless VSP Q6 mang thiết kế truyền thống với\r\nmàu đen sang trọng từ vật liệu nhựa ABS cho cảm giác cầm tay vừa vặn, thoải mái\r\ntrong việc di chuyển cũng như hỗ trợ các chức năng giảng dạy, học tập và làm việc.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Độ\r\nphân giải lên đến 1600DPI<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột được trang bị công nghệ chuột quang tiên tiến cho độ\r\nphân giải lên đến 1600DPI. Độ phân giải cao giúp chuột có thể di chuyển nhanh\r\nvà mượt mà trên nhiều bền mặt, đảm bảo hiệu quả cho công việc, học tập cũng như\r\ngiải trí.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Công\r\nnghệ không dây 2.4GHz tiến tiến<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột được trang bị công nghệ kết nối không dây tiên tiến\r\n2.4GHz có độ tin cậy cao. Công nghệ này đảm bảo kết nối liên tục giữa chuột và\r\nmáy tính, cho phép dữ liệu được truyền tải chính xác, không bị gián đoạn và\r\nnhanh hơn 60% so với công nghệ cũ trước đây.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Thời\r\ngian sử dụng pin lâu<o:p></o:p></span></i></b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Chuột sử dụng nguồn năng lượng từ pin AA cùng công nghệ\r\nquang ẩn giúp kéo dài tuổi thọ pin. Chuột có thể hoạt động liên tục lên đến 12\r\ntháng, giúp bạn tiết kiệm chi phí hơn và không còn lo lắng công việc bị gián đoạn\r\ngiữa chừng.<o:p></o:p></p>', 80000, 120000, 100000, 20, 0, '2021-03-20 01:42:04', '2021-05-17 08:06:43', 'Chuột không dây wireless VSP Q6, chính hãng, giá rẻ Đà Lạt. Linh 