(121, 3, '28', 'Tai nghe Siêu Trâu Qinlian A6 dây dù bọc Silicon cực chắc', 'unknown', '/assets/uploads/products/1616312729_sub_unknown.pasted image 0.png', '<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Headphone Siêu Trâu A6 QINLIAN cực chất</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Qinlian A6 là tai nghe game được rất nhiều phòng game lớn săn tìm thời gian qua bởi độ bền và chất lượng.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Được làm bằng chất liệu nhựa siêu bền, Ốp 2 tai làm bằng da rất mềm êm, ôm trọn tai và không làm đau tai như các loại tai nghe khác.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Vành tai có thể tháo ra để vệ sinh khi cần. Kiểu dáng thiết kế thời trang cùng gam màu Đỏ, xanh, Trắng nổi bật phong cách game thủ. Microphone Qinlian A6 được tích hợp ngay bên tai trái, sản xuất bằng nhựa dẻo lên có thể bẻ thoải mái. Dây tai nghe dài 2,3M được làm bằng dây dù chống đứt + bọc thêm lớp nhựa trong dẻo bên ngoài dây càng tăng thêm độ bền của dây.</span></p><p><span id=\"docs-internal-guid-02873fba-7fff-9273-f65f-56d84b25ca43\"></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12.499999999999998pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Thiết kế phần gọng tai nghe vững chắc với nhựa dẻo chống gãy, giảm áp lực trọng lượng lên đầu, tăng sự thoải mái khi đeo tai nghe.</span></p>', 160000, 200000, 160000, 10, 0, '2021-03-21 00:45:29', '2021-03-21 00:45:29', 'Tai nghe Siêu Trâu Qinlian A6 dây dù bọc Silicon cực chắc giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Siêu Trâu Qinlian A6 dây dù bọc Silicon cực chắc giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Siêu Trâu Qinlian A6 dây dù bọc Silicon cực chắc - chính hãng-giá rẻ', 'Tai nghe Siêu Trâu Qinlian A6 dây dù bọc Silicon cực chắc - chính hãng-giá rẻ'),
(122, 3, '28', 'Tai nghe chụp tai Bosston HS-09 Led đa màu', 'unknown', '/assets/uploads/products/1616312975_sub_unknown.pasted image 0.png', '<p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 12pt; line-height: 1.15;\"><span class=\"c21 c44 c48\" style=\"vertical-align: baseline; color: rgb(45, 45, 45); font-weight: 700; font-size: 14pt;\">Với Tai nghe chụp tai chuyên Game Bosston Bosston HS-09 Led đa màu bạn có thể thỏa thích chơi game với âm thanh trung thực, sống động, đồng thời vẫn thưởng thức âm nhạc của bạn ở bất cứ nơi nào: khi tập thể dục, khi lái xe, khi ngồi học, khi làm việc…mà không sợ làm phiền hay ảnh hưởng đến những người bên cạnh.</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 12pt; line-height: 1.15;\"><span class=\"c0\" style=\"color: rgb(33, 37, 41); font-weight: 700; vertical-align: baseline; font-size: 14pt;\">Tai nghe chụp tai chuyên Game Bosston HS-09 Led đa màuđược thiết kế theo phong cách truyền thống của dòng tai nghe chụp tai với cầu nối khỏe khoắn và mạnh mẽ nhưng vẫn giữ được nét tinh tế vốn có nhờ lớp bọc ngoài dày dặn nhưng mềm mại, ôm sát khuôn đầu mà không hề tạo cảm giác bức bối, khó chịu. Phần đệm tai dày và êm ái để bạn có thể nghe nhạc trong thời gian dài mà vẫn cảm thấy dễ chịu. Bên cạnh đó, thiết kế đệm tai còn giúp âm thanh được giữ kín, âm bass thật sâu và trầm, tạo hiệu ứng âm thanh tốt hơn cho bạn.</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 12pt; line-height: 1.15;\"><span class=\"c0\" style=\"color: rgb(33, 37, 41); font-weight: 700; vertical-align: baseline; font-size: 14pt;\">Với dải âm tần rộng và độ nhạy âm cao, người dùng sẽ thật sự tràn ngập trong một thế giới âm nhạc sống động, âm 