(125, 3, '28', 'Tai Nghe Bosston HS-12', 'unknown', '/assets/uploads/products/1616313812_sub_unknown.pasted image 0 (2).png', '<p class=\"c5\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt 11.2pt 3.8pt 7.5pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c25 c28\" style=\"vertical-align: baseline; font-size: 10pt;\">Tai Nghe Chụp Tai Gaming Bosston HS-12 Led Rainbow - Hàng Chính Hãng sở hữu thiết kế trẻ trung, năng động với dạng tai nghe chụp tai nhỏ gọn, chắc chắn kết hợp lớp đệm êm ái mang đến cảm giác thoải mái trong suốt quá trình sử dụng.</span></p><p class=\"c5\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt 11.2pt 3.8pt 7.5pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c25 c28\" style=\"vertical-align: baseline; font-size: 10pt;\">Ngoài ra, Phần đệm tai dày và êm ái để bạn có thể nghe nhạc trong thời gian dài mà vẫn cảm thấy dễ chịu. Bên cạnh đó, thiết kế đệm tai còn giúp âm thanh được giữ kín, âm bass thật sâu và trầm, tạo hiệu ứng âm thanh tốt hơn cho bạn.</span></p><p class=\"c5\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt 11.2pt 3.8pt 7.5pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c25 c28\" style=\"vertical-align: baseline; font-size: 10pt;\">Thiết bị được tích hợp microphone 42dB ± 3dB trên tai nghe giúp bạn trả lời cuộc gọi nhanh chóng, âm thanh to rõ. Đặc biệt, với hệ thống đèn LED tự chuyển màu ấn tượng giúp bạn khẳng định phong cách riêng biệt với người xung quanh.</span></p><p class=\"c5\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt 11.2pt 3.8pt 7.5pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c25 c28\" style=\"vertical-align: baseline; font-size: 10pt;\">Sản phẩm được trang bị công nghệ xử lý tiếng ồn tai nghe giúp bạn có thể dễ dàng đàm thoại hiệu quả trong nhiều môi trường khác nhau. Đồng thời với dải tần 20 Hz , độ nhạy 118dB ± 3dB tai nghe mang đến chất lượng âm thanh trung thực với hiệu ứng bass sâu và mức âm lượng tốt giúp bạn thưởng thức những giai điệu sống động, mạnh mẽ.</span></p><p class=\"c5\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt 11.2pt 3.8pt 7.5pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c25 c28\" style=\"vertical-align: baseline; font-size: 10pt;\">Bên cạnh đó bạn có thể lựa chọn cổng kết nối USB cho LED &nbsp;và Jack 3.5 Cho âm thanh, dễ dàng tương thích với tất cả các thiết bị có jack 3.5.</span></p>', 270000, 300000, 270000, 10, 0, '2021-03-21 01:03:32', '2021-03-21 01:03:32', 'Tai Nghe Bosston HS-12 giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai Nghe Bosston HS-12 giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai Nghe Bosston HS-12 - chính hãng-giá rẻ', 'Tai Nghe Bosston HS-12 - chính hãng-giá rẻ'),
(126, 3, '28', 'Tai nghe chụp tai kèm mic Soundmax AH 304 (Đen)', 'unknown', '/assets/uploads/products/1616314016_sub_unknown.pasted image 0 (1).png', '<p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">Tai Nghe SoundMax AH304 có thiết kế màu đen sang trọng, viền khung đầu bằng kim loại màu trắng bạc, cùng lớp đệm giả da tạo cảm giác êm dịu không gây đau đầu. Phần tai nghe ôm sát vừa tai, có lớp đệm dày bảo đảm âm thanh không lọt ra ngoài và cảm giác êm ái, dễ chịu khi nghe nhạc.</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">Tai Nghe SoundMax AH304 có trang bị microphone đi kèm cho chất lượng âm thanh cao và chống nhiễu giúp bạn có thể \"tám\" với bạn bè một cách thoải mái. Tai Nghe SoundMax AH304 thích hợp cho việc hưởng thụ những bài hát, những bộ phim mà bạn yêu thích mà không sợ làm phiền đến bất cứ ai, cũng như việc góp phần vào việc kết nối với bạn bè từ xa qua chat chít, skype hay yahoo...</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">Tính năng sản phẩm:</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">- Đáp ứng dải tần số âm thanh từ &nbsp;20Hz-20KHz cho phép nghe nhiều dòng nhạc.</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">- Control điều khiển được đính kèm trên dây gồm nút vặn tăng giảm âm lượng và tắt mở micro.</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">- Tai nghe cho âm thanh chuẩn, sống động.</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">- Sử dụng jack cắm 3.5mm tương thích với nhiều thiết bị di động.</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">- Tính năng: Lọc tạp âm, nghe nhạc, có micro.</span></p><p class=\"c13\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 4pt; padding-bottom: 9pt; line-height: 1.15; text-align: justify;\"><span class=\"c3\" style=\"color: rgb(36, 36, 36); font-weight: 700; vertical-align: baseline; font-size: 10.5pt; font-family: Roboto;\">- Dây dài 2m khả năng di động cao, phù hợp để kết nối với điện thoại khi di chuyển, hay với các máy PC đặt ở xa tạo cảm giác không vướng víu khi sử dụng.</span></p>', 270000, 300000, 270000, 10, 0, '2021-03-21 01:06:56', '2021-03-21 01:06:56', 'Tai nghe chụp tai kèm mic Soundmax AH 304 (Đen) giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe chụp tai kèm mic Soundmax AH 304 (Đen) giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe chụp tai kèm mic Soundmax AH 304 (Đen) - chính hãng-giá rẻ', 'Tai nghe chụp tai kèm mic Soundmax AH 304 (Đen) - chính hãng-giá rẻ'),
(127, 3, '28', 'Tai nghe Samsung box', 'unknown', '/assets/uploads/products/1616314288_sub_unknown.tai-nghe-samsung-galaxy-s7s7-edge-full-box-made-in-viet-nam-2615-46561791-1ba40084b76efb6f131fbebd830f08fc.jpg_500x500Q80.jpg', '<p><span style=\"font-family: Arial; font-weight: 700;\">Tai nghe in-ear cao cấp Galaxy S6 được thiết kế theo phong cách hiện đại thích hợp sử dụng cho các bạn trẻ đam mê âm nhạc và phong cách cá tính. - Nhiều ưu điểm vượt trội từ kiểu dáng đến chất lượng mang lại cho bạn những giây phút thư giãn với âm nhạc mọi lúc mọi nơi. - Cấu tạo màng loa hiện đại, là chiếc tai nghe xuất sắc cho bạn thưởng thức các giai điệu nhạc mạnh mẽ, hoàn hảo. - Jack cắm tiêu chuẩn 3.5mm thích hởp sử dụng với các thiết bị giải trí số tạo sự tiện dụng cho bạn trong quá trình sử dụng. - Kiểu dáng nhỏ gọn, tiện lợi cho bạn đem theo bên mình.</span><br></p>', 50000, 100000, 50000, 10, 0, '2021-03-21 01:11:28', '2021-03-21 01:11:28', 'Tai nghe Samsung box giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Samsung box giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Samsung box - chính hãng-giá rẻ', 'Tai nghe Samsung box - chính hãng-giá rẻ'),
(128, 3, '28', 'Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955', 'unknown', '/assets/uploads/products/1616314580_sub_unknown.pasted image 0.png', '<p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c14\" style=\"font-weight: 700; vertical-align: baseline; font-size: 14pt;\">Thiết kế êm ái - chất lượng âm thanh tuyệt vời</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 được ra mắt cùng với sự xuất hiện của dòng điện thoại Galaxy S8 của Samsung. Thay vì bỏ đi Jack tai nghe 3.5mm như các dòng điện thoại được tung ra thị trường gần đây, Samsung đã chọn một sự thay đổi khác biệt hơn đó là trang bị một loại tai nghe cực kỳ cao cấp cho sản phẩm của mình từ sự hợp tác cùng với AKG - một nhà sản xuất tai nghe rất nổi tiếng. Bạn sẽ được trải nghiệm chất lượng âm thanh cực kỳ hoàn hảo, ngay cả đối với những đôi tai khó chịu nhất. Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 với thiết kế bo tròn rất thoải mái và êm tai, phù hợp với mọi kiểu dáng tai với miếng đệm Silicon êm ái, không làm đau tai khi sử dụng.</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c0\" style=\"font-weight: 700; vertical-align: baseline; font-size: 18pt;\">Tiêu chuẩn chất lượng cao nhất</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Với những tiêu chuẩn riêng về chất lượng cực kỳ nghiêm ngặt từ hai nhà sản xuất nổi tiếng thế giới AKG và Samsung. Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 được thiết kế và sản xuất với tiêu chuẩn cao nhất về thiết kế, chất lượng âm thanh cũng như độ bền của sản phẩm. Kích thước Drive 12mm cùng với trở kháng 32ohm cho âm Bass cực sâu và siêu mềm, âm Treble trong trẻo đồng thời chống chói tai, dải Mid rõ ràng và không bị lẫn tạp bởi các tần số khác. Thiết kế độc đáo chống bị trượt ra khỏi tai khi sử dụng, dây bọc dù chống rối và chống đứt. Tất cả đều được hội tụ trong sản phẩm tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c0\" style=\"font-weight: 700; vertical-align: baseline; font-size: 18pt;\">Thiết kế tinh tế - thời trang</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 được thiết kế phần tiếp xúc có hướng cong xuống giúp giữ tai nghe tốt hơn mà không cần phải nhét sâu vào tai gây đau nhức khi sử dụng. Phần Mic được thiết kế xa hơn 1 chút và được làm cực mỏng và cực nhẹ giúp Earbud tránh bị kéo xuống gây khó chịu. Các nút Control được thiết kế êm ái, tạo cảm giác vừa êm nhưng vẫn không làm mất cảm bấm.</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c0\" style=\"font-weight: 700; vertical-align: baseline; font-size: 18pt;\">Nút điều khiển</span></p><p class=\"c15\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 11pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Trên Android, bạn có thể kiểm soát âm lượng, tạm dừng hoặc phát nhạc, chọn qua bài hát tiếp theo và truy cập Google Assistant. Trên iOS, bạn không thể kiểm soát âm lượng nhưng bạn có thể chọn qua bài hát tiếp theo, tạm dừng hoặc phát nhạc, truy cập Siri, và thậm chí trở lại bài hát trước bằng cách nhấp 1, 2, 3 lần vào nút Multifunction nằm ở giữ.</span></p>', 120000, 150000, 120000, 10, 0, '2021-03-21 01:16:20', '2021-03-21 01:16:20', 'Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 - chính hãng-giá rẻ', 'Tai nghe Samsung Galaxy S8 AKG 3.5mm Stereo EO-IG955 - chính hãng-giá rẻ');
