(129, 3, '28', 'Tai Nghe Xiaomi Mi In-Ear Headphones Basic', '6985157849655', '/assets/uploads/products/1616314753_sub_6985157849655.pasted image 0.png', '<h2 class=\"c20\" id=\"h.y1473wjdkm8e\" style=\"padding: 0pt; color: rgb(0, 0, 0); font-size: 16pt; font-family: Arial; break-after: avoid; text-align: justify; border-style: solid; border-width: 0pt;\"><span class=\"c26 c29 c43\" style=\"vertical-align: baseline; color: rgb(51, 51, 153); font-size: 15pt;\">Tai nghe Xiaomi In-Ear headphones Basic thiết kế tinh xảo</span></h2><p class=\"c24\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c13\" style=\"font-size: 12pt; font-weight: 700;\">Là một sản phẩm mang thương hiệu Xiaomi chiếc&nbsp;</span><span class=\"c13 c28\" style=\"font-size: 12pt; font-weight: 700; color: rgb(0, 0, 255);\"><a class=\"c39\" href=\"https://www.google.com/url?q=https://mobilecity.vn/phu-kien/tai-nghe-xiaomi-in-ear-headphones-basic.html&amp;sa=D&amp;source=editors&amp;ust=1616317684890000&amp;usg=AOvVaw0ZSFwYvc3_IwV65PBXLOlm\" style=\"color: inherit; text-decoration: inherit;\">tai nghe Xiaomi In-Ear headphones Basic</a></span><span class=\"c26 c13 c27\" style=\"vertical-align: baseline; font-size: 12pt; font-weight: 700;\">&nbsp;còn được gọi là tai nghe Piston 3.0khiến người dùng không khỏi thích thú khi nó sở hữu những điểm mới và độc đáo trong thiết kế. Khá sang chảnh trong thiết kế với vỏ nhôm chống vân viền nhôm kim loại cho người dùng sự sang trọng và tinh tế nhưng cũng không kém phần trẻ trung. Tai nghe Xiaomi In-Ear headphones Basic 2018 với viền kim loại được làm đồng màu với tai nghe và chiếc khung nhôm cho âm thanh cực chất. Cùng với nhiều màu sắc thời trang, trẻ trung cho người dùng lựa chọn một cách thoải mái, phù hợp với sở thích của mình.</span></p><h3 class=\"c32\" id=\"h.jce0kn9bv8x0\" style=\"padding: 0pt; color: rgb(67, 67, 67); font-size: 14pt; font-family: Arial; line-height: 1.16667; break-after: avoid; text-align: justify; border-style: solid; border-width: 0pt;\"><span class=\"c26 c35 c29\" style=\"vertical-align: baseline; color: rgb(51, 51, 153); font-size: 13.5pt;\">Tai nghe Xiaomi In-Ear Headphones Basic cho chất lượng âm thanh tối ưu nhất</span></h3><p class=\"c24\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c26 c13 c27\" style=\"vertical-align: baseline; font-size: 12pt; font-weight: 700;\">Được làm bằng PET, xết lớp ở thiết kế bên trong, chiếc tai nghe Xiaomi In-Ear headphones Basic 2016 này tạo ra nhiều không gian hơn cho âm thanh và mỗi một lớp đảm nhiệm các chức năng khác nhau rồi liên kết lại theo những chất lượng của file nhạc tạo nên những âm &nbsp;thanh tốt nhất, hay nhất. Với thiết kế này, bạn có thể nghe thấy rõ từng âm thanh với những âm điệu chi tiết nhất khi trải nghiệm. Chắc chắn bạn sẽ cảm thấy thích thú với chiếc tai nghe Xiaomi In-Ear headphones Basic này, và khi chất lượng 320kbps trở nên thì chất lượng âm thanh càng trở nên sống động.</span></p><p class=\"c24\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c26 c13 c27\" style=\"vertical-align: baseline; font-size: 12pt; font-weight: 700;\">Ngoài ra, chiếc tai nghe này cũng được trang bị một hệ thống lọc âm 3 tầng giúp lọc bỏ tốt nhất các tạp âm cho người dùng những trải nghiệm tốt nhất với những giây phút cực kì thư giãn.</span></p><h3 class=\"c32\" id=\"h.6x4mc2nb5o4v\" style=\"padding: 0pt; color: rgb(67, 67, 67); font-size: 14pt; font-family: Arial; line-height: 1.16667; break-after: avoid; text-align: justify; border-style: solid; border-width: 0pt;\"><span class=\"c26 c35 c29\" style=\"vertical-align: baseline; color: rgb(51, 51, 153); font-size: 13.5pt;\">Thiết kế dây tai nghe Xiaomi In-Ear Headphones Basic chống rối</span></h3><p class=\"c6 c16\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15; height: 11pt;\"><span class=\"c26 c29 c41\" style=\"vertical-align: baseline; color: rgb(51, 51, 153); font-weight: 700; font-size: 15.5pt;\"></span></p><p class=\"c24\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; border-style: solid; padding: 0pt; border-width: 0pt; line-height: 1.70455; text-align: justify;\"><span class=\"c13\" style=\"font-size: 12pt; font-weight: 700;\">Chiếc tai nghe mới này được thiết kế với chiếc dây được bọc bên ngoài lớp nhựa PET với dạng dây dẹt chống rối, tiện lợi và chắc chắn cho người sử dụng, cùng với chất liệu dây mịn khó bắt bụi làm cho chiếc điện thoại của bạn giữ được lâu hơn. Bên cạnh đó là kích thước nhỏ gọn cũng không kém phần tiện dụng với độ dài dây phù hợp 1.25m,&nbsp;</span><span class=\"c13 c28\" style=\"font-size: 12pt; font-weight: 700; color: rgb(0, 0, 255);\"><a class=\"c39\" href=\"https://www.google.com/url?q=https://mobilecity.vn/phu-kien/tai-nghe-xiaomi-in-ear-headphones-basic.html&amp;sa=D&amp;source=editors&amp;ust=1616317684892000&amp;usg=AOvVaw2bQSUzmFXZN3wEb1hEMvER\" style=\"color: inherit; text-decoration: inherit;\">tai nghe Xiaomi In-Ear Headphones Basic chính hãng</a></span><span class=\"c26 c13 c27\" style=\"vertical-align: baseline; font-size: 12pt; font-weight: 700;\">&nbsp;cho độ dài linh hoạt khi sử dụng.</span></p><h3 class=\"c32\" id=\"h.dubdf0uzvg5k\" style=\"padding: 0pt; color: rgb(67, 67, 67); font-size: 14pt; font-family: Arial; line-height: 1.16667; break-after: avoid; text-align: justify; border-style: solid; border-width: 0pt;\"><span class=\"c26 c29 c35\" style=\"vertical-align: baseline; color: rgb(51, 51, 153); font-size: 13.5pt;\">Hiệu năng ổn định trên tai nghe Xiaomi In-Ear Headphones Basic</span></h3><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c13\" style=\"font-size: 12pt; font-weight: 700;\">Với công suất 5mW cùng tần số 20-20,000Hz, chắc chắn bạn sẽ cảm thấy hài lòng về chiếc tai nghe Xiaomi In-Ear headphones Basic này. Đặc biệt với tiêu chuẩn GT/T 14471-2013 bạn hoàn toàn có thể yên tâm về nó trong quá trình sử dụng. bên cạnh đó thì chiếc tai nghe Xiaomi này cũng có một mức giá khá ổn với một chất lượng cực tốt</span></p>', 150000, 200000, 150000, 10, 0, '2021-03-21 01:19:13', '2021-03-21 01:19:13', 'Tai Nghe Xiaomi Mi In-Ear Headphones Basic giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai Nghe Xiaomi Mi In-Ear Headphones Basic giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai Nghe Xiaomi Mi In-Ear Headphones Basic - chính hãng-giá rẻ', 'Tai Nghe Xiaomi Mi In-Ear Headphones Basic - chính hãng-giá rẻ'),
(130, 3, '28', 'Tai nghe bluetooth Usam KL001', 'unknown', '/assets/uploads/products/1616315031_sub_unknown.pasted image 0.png', '<p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Tai Nghe Bluetooth USAM LK001 sẽ mang đến cho bạn trải nghiệm hoàn toàn mới so với những dòng tai nghe thông thường trên thị trường hiện nay.</span></p><p class=\"c6 c16\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15; height: 11pt;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\"></span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">MÔ TẢ SẢN PHẨM</span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Tai Nghe Bluetooth USAM LK001 được trang bị mic đàm thoại cực tốt, không có cần mic mà vẫn cho bạn cuộc gọi tốt hơn bao giờ.</span></p><p class=\"c6 c16\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15; height: 11pt;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\"></span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Tai Nghe Bluetooth USAM LK001 sử dụng công nghệ Bluetooth 4.0 EDR siêu tiết kiệm pin. Có tính năng bắt cuộc gọi bằng giọng nói. “Yes” là bắt máy, “No” là từ chối cuộc gọi.</span></p><p class=\"c6 c16\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15; height: 11pt;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\"></span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Tai nghe được trang bị chip bluetooth thế hệ chuẩn 4.0, ngoài tính năng chống ồn tai nghe còn được hỗ trợ tính năng chống nhiễu sóng, loại bỏ những tạp âm ồn ào cả cho người nghe lẫn người gọi điện thoại.</span></p><p class=\"c6 c16\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15; height: 11pt;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\"></span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\">Tai nghe được trang bị các phím chức năng riêng biệt giúp bạn dễ dàng sử dụng.</span></p><p class=\"c6 c16\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15; height: 11pt;\"><span class=\"c8\" style=\"font-weight: 700; vertical-align: baseline; font-size: 10.5pt;\"></span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c29 c30\" style=\"font-size: 10.5pt; font-weight: 700;\">Đặc biệt và tiện ích hơn bao giờ hết, tai nghe LK001 còn có thể kết nối hoạt động 2 thiết bị cùng lúc. Còn gì tuyệt vời và tiết kiệm hơn khi với 01 chiếc tai nghe mà bạn có thể kết nối với cả hai thiết bị cùng lúc.</span></p>', 180000, 200000, 180000, 10, 0, '2021-03-21 01:23:51', '2021-03-21 01:23:51', 'Tai nghe bluetooth Usam KL001 giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe bluetooth Usam KL001 giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe bluetooth Usam KL001 - chính hãng-giá rẻ', 'Tai nghe bluetooth Usam KL001 - chính hãng-giá rẻ'),
(131, 3, '28', 'Tai nghe Bluetooth REMAX RB-T9', 'unknown', '/assets/uploads/products/1616315291_sub_unknown.remax-t9-2.jpg', '<p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"font-weight: 700; vertical-align: baseline; font-size: 11pt;\">Tai nghe bluetooth RB-T9 được trang bị công nghệ Bluetooth 4.1. Giúp bạn dễ dàng kết nối với các thiết bị có tích hợp chức năng Bluetooth. Công nghệ này cho phép người dùng có thể sử dụng tai nghe trong phạm vi bắt sóng lên đến 10m. Với kết nối ổn định, giải mã âm thanh không dây tuyệt vời</span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"font-weight: 700; vertical-align: baseline; font-size: 11pt;\">Ngoài công nghệ hiện đại, tai nghe bluetooth RB-T9 cũng được người dùng tại Remax chấm điểm khá cao. Mặt ngoài của tai nghe RB-T9 được tạo kiểu theo phong cách vẩy cá khá đặc biệt. Thiết kế này giúp cho chiếc tai nghe nổi bật và thời trang hơn</span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"font-weight: 700; vertical-align: baseline; font-size: 11pt;\">Sản phẩm có hình sáng khá nhỏ gọn với kích thước chỉ 58 x 21.8 x 4.3 mm. Toàn bộ tai nghe được làm từ chất liệu nhựa ABS cao cấp. Chính vì vậy, người dùng sẽ không hề cảm thấy nặng nề khi mang.</span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"font-weight: 700; vertical-align: baseline; font-size: 11pt;\">Điểm nổi bật nhất ở chiếc tai nghe RB-T9 này là nó được trang bị công nghệ âm thanh HD Voice và hệ thống xử lý tạp âm CVC. Giúp người dùng có được một trải nghiệm âm thanh trung thực và chất lượng. Kể cả khi đàm thoại hay nghe nhạc dù ở bất kì môi trường nào.</span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"font-weight: 700; vertical-align: baseline; font-size: 11pt;\">Mặc dù có kích thước khá nhỏ, nhưng tai nghe bluetooth RB-T9 được tích hợp dung lượng pin nghe khá lớn. Dung lượng gần như gấp đôi nhiều loại tai nghe bluetooth phổ biến hiện nay cho bạn thời lượng sử dụng lâu hơn. RB-T9 được trang bị pin 100mAh với thời gian đàm thoại liên tục lên đến 4 – 5 giờ và thời gian chờ tới 100 giờ.</span></p><p class=\"c6\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"font-weight: 700; vertical-align: baseline; font-size: 11pt;\">Tai nghe Bluetooth RB-T9 được đi kèm với các ear-tips silicone có các kích thước khác nhau. Giúp cho tai nghe êm ái hơn và có thể phù hợp với mọi đối tượng. Được thiết kế trên đầu tai nghe có vành tai có vai trò giữ cho chiếc tai nghe nằm chắc chắn hơn.</span></p>', 220000, 250000, 220000, 10, 0, '2021-03-21 01:28:11', '2021-03-21 01:28:11', 'Tai nghe Bluetooth REMAX RB-T9 giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Bluetooth REMAX RB-T9  giá rẻ, chính hãng, âm thanh chất lượng cao. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.Chỉ có tại MNSCenter.com', 'Tai nghe Bluetooth REMAX RB-T9 - chính hãng-giá rẻ', 'Tai nghe Bluetooth REMAX RB-T9\r\n\r\n - chính hãng-giá rẻ'),
