(134, 3, '24', 'Pin sạc dự phòng Xiaomi Gen 3, 2 USB, 1 USB-C 10000mAh (PLM13ZM) - Tặng ốp silicon', 'unknown', '/assets/uploads/products/1616316107_sub_unknown.pin-sac-du-phong-xiaomi-10000mah-gen-3-2019-sac-nhanh-18w-plm13zm-1.jpg', '<p class=\"c3\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline; font-size: 11.5pt;\">Tương tự những sản phẩm trước, sạc dự phòng Xiaomi 10000mAh Gen 3 Type C 2019 được trang bị lõi pin Li-Po (Lithium Polymer) đến từ nhà sản xuất hàng đầu như LG/Panasonic. Vì thế bạn có thể an tâm về chất lượng cũng như tuổi thọ của sản phẩm.</span></p><p class=\"c3\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c6 c9\" style=\"font-size: 12pt; color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline;\">Song song với đó, sạc dự phòng này cũng có dung lượng lên đến 10000mAh. Đây là mức dung lượng pin rất ổn cho một thiết bị pin dự phòng, cho phép bạn có thể dùng để sạc cho iPhone 8 3,5 lần, sạc cho iPhone X 2.5 lần, và Galaxy Note 9 2 lần hơn. Với một thiết bị sạc như thế thì bạn chỉ cần sạc đầy qua đêm là đã có thể sử dụng thoải mái trong một ngày làm việc sau đó.</span></p><p class=\"c3\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline; font-size: 11.5pt;\">Một trong những điểm khiến Xiaomi 10000mAh Gen 3 Type C 2019 nổi bật hơn những thiết bị sạc khác, chính là ở khả năng sạc nhanh tối đa 18W thông qua cổng USB Type C. Với 2 cổng sạc vào USB Type C và Micro USB với cường độ 5V - 2.6A, 9V - 2.1A, 12V - 1.5A , hỗ trợ sạc nhanh tối đa 18W. Nhờ đó có thể sạc nhanh cho pin dự phòng.</span></p><p class=\"c24\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 8pt; line-height: 1.15;\"><span class=\"c2\" style=\"color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline; font-size: 11.5pt;\">Cùng với 2 cổng sạc vào là 2 đầu ra USB với cường độ 5V - 2.6A, 9V - 2.1A, 12V - 1.5A cũng hỗ trợ sạc nhanh tối đa 18W khi sạc riêng từng cổng. Khi sạc đông thời 2 cổng mực điện áp còn 5V - 2.6A.</span></p><p class=\"c24\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 8pt; line-height: 1.15;\"><span class=\"c2\" style=\"color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline; font-size: 11.5pt;\">Hai cổng sạc trên cũng có khả năng nhận diện thiết bị rất tốt, nhằm đảm bảo nguồn ra chính xác và hợp lý cho từng loại thiết bị khác nhau. Đặc biệt hơn, Xiaomi cũng đảm bảo rằng thiết bị sạc dự phòng của mình sẽ tương thích với hầu hết các loại smartphone có mặt trên thị trường ở thời điểm hiện tại</span></p><p class=\"c3\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline; font-size: 11.5pt;\">Xiaomi 10000mAh Gen 3 2019 có một thiết kế rất nhỏ gọn liền lạc, các đường nét, chi tiết đều được Xiaomi thiết kế rất khéo léo nhằm không đưa đến cho người dùng quá nhiều chi tiết thừa. Thiết bị được kết cấu với một lớp vỏ kim loại có độ bền cấu trúc rất cao, cảm giác cầm trong tay rất mịn màng, mát tay. Bên cạnh đó, trọng lượng của sạc cũng không qua nặng. Bạn có thể cầm thiết bị trên tay mà không cảm giác mỏi, cũng như để trong túi quần mà không ngại cảm giác chật chội, nặng nề.</span></p><p class=\"c3\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline; font-size: 11.5pt;\">Những vị trí cổng sạc ra – vào đều được xử lý công nghệ CNC cho cảm giác sang trọng, tinh tế, an tâm từ lần đầu tiên sử dụng. Bên cạnh đó, sạc dự phòng Xiaomi Gen 3 2019 cũng được trang bị 4 đèn LED nhằm thông báo mức pin đang có của thiết bị.</span></p><p class=\"c3\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-size: 11pt; font-family: Arial; padding-top: 0pt; padding-bottom: 0pt; line-height: 1.15;\"><span class=\"c2\" style=\"color: rgb(37, 37, 37); font-weight: 700; vertical-align: baseline; font-size: 11.5pt;\">Nhờ việc sử dụng cảm biến RC, Xiaomi Gen 3 2019 có thể dễ dàng xử lý các tình huống bất cập như quá nhiệt, chập nhiệt, quá tải, xả quá mức một cách dễ dàng. Song song với đó, cảm biến này cũng có độ chính xác rất cao, cùng với hệ thống mạnh tiên tiến. Bạn có thể an tâm rằng hiệu suất của việc sạc và xả luôn được giữ ở mức ổn định, an tâm nhất có thể.</span></p>', 420000, 450000, 420000, 10, 0, '2021-03-21 01:41:47', '2021-03-21 01:41:47', 'Pin sạc dự phòng Xiaomi Gen 3, 2 USB, 1 USB-C 10000mAh (PLM13ZM) giá tốt, chính hãng, tốc độ sạc nhanh, an toàn. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.', 'Pin sạc dự phòng Xiaomi Gen 3, 2 USB, 1 USB-C 10000mAh (PLM13ZM) giá tốt, chính hãng, tốc độ sạc nhanh, an toàn. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.', 'Pin sạc dự phòng Xiaomi Gen 3, 2 USB, 1 USB-C 10000mAh (PLM13ZM) - Tặng ốp silicon', 'Pin sạc dự phòng Xiaomi Gen 3, 2 USB, 1 USB-C 10000mAh (PLM13ZM) - Tặng ốp silicon'),
(135, 3, '24', 'Pin sạc dự phòng 20000mAh Xiaomi Redmi PB200LZM - 2 cõng sạc vào USB-A + Micro USB / 2 cõng sạc ra USB-A 74Wh (NEW 2019)', 'unknown', '/assets/uploads/products/1616316348_sub_unknown.pin-sac-redmi-20000mah__1__ac9b478cc9b84ae1bd80298692239cc2_compact.jpg', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif; white-space: pre-wrap;\">Pin sạc dự phòng 20000mAh Xiaomi Redmi PB200LZM - 2 cõng sạc vào USB-A + Micro USB / 2 cõng sạc ra USB-A 74Wh (NEW 2019)\r\nModel: PB200LZM\r\nKích thước: 154 x 73.6 x 27.3mm\r\nDung lượng pin: 74Wh ~ 20000mAh\r\nDung lượng thật: 12000mAh\r\nInput: 5V-2.4A/ 9V-2A/ 12V-1.5A (micro-USB/USB-C)\r\nOutput: 5.1V-2.4A/ 9V-2A/ 12V-1.5A (max 1 cổng)\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5.1V-3.6A (max cả 2 cổng)\r\nBộ phụ kiện chỉ là cục pin dự phòng, sách hướng dẫn + hộp, ko kèm cáp sạc</span><br></p>', 390000, 400000, 390000, 10, 0, '2021-03-21 01:45:48', '2021-03-21 01:45:48', 'Pin sạc dự phòng 20000mAh Xiaomi Redmi PB200LZM - 2 cõng sạc vào USB-A + Micro USB / 2 cõng sạc ra USB-A 74Wh (NEW 2019) giá tốt, chính hãng, tốc độ sạc nhanh, an toàn. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.', 'Pin sạc dự phòng 20000mAh Xiaomi Redmi PB200LZM - 2 cõng sạc vào USB-A + Micro USB / 2 cõng sạc ra USB-A 74Wh (NEW 2019) giá tốt, chính hãng, tốc độ sạc nhanh, an toàn. Bảo hành 1 đổi 1 trong vòng 1 năm nếu lỗi, giao hàng tận nơi.', 'Pin sạc dự phòng 20000mAh Xiaomi Redmi PB200LZM - 2 cõng sạc vào USB-A + Micro USB / 2 cõng sạc ra USB-A 74Wh (NEW 2019)', 'Pin sạc dự phòng 20000mAh Xiaomi Redmi PB200LZM - 2 cõng sạc vào USB-A + Micro USB / 2 cõng sạc ra USB-A 74Wh (NEW 2019)'),
