(146, 2, '17', 'Dell G3 15 3500A i7 10750H', '3500A i7 10750H', '/assets/uploads/products/1621264923_sub_3500A i7 10750H.1616318901_small_3500A i5 10300H.Background (2).png', '<p>Laptop gaming Dell Gaming G3 15 3500 (G3500A) được với chip xử lí đồ họa rời NVIDIA và bộ vi xử lí thế hệ thứ 10 mới nhất cùng thiết kế mỏng nhưng vẫn mang đến trải nghiệm chơi game tuyệt vời.</p><p>Đồ họa vượt trội: Với GTX1650Ti cho phép bạn trải nghiệm game ở mức cao hơn, hình ảnh chân thực và mượt mà hơn.</p><p>Tuyệt vời từ mọi góc độ: Gameplay sẽ luôn sắc nét ở mọi góc độ nhờ màn hình 15 inch góc rộng và tính năng anti glare chống chói.</p><p>Âm thanh tuyệt hảo: Đắm mình trong âm thanh tuyệt vời với hai loa Waves MaxxAudio® Pro.</p><p>Tối ưu hiệu năng</p><p>Nâng cao sức mạnh để chơi game tốt hơn là tiêu chí của Dell Gaming G3 15 3500 (G3500A) do đó sản phẩm phải được trang bị CPU thế hệ 8 mới nhất, để bạn có thể thỏa sức chơi game, stream cũng như làm xử lý công việc hiệu quả.</p><p>Thiết kế 2 quạt kép cho phép bạn chơi game không bị gián đoạn và đảm bảo nhiệt độ hệ thống luôn mát mẻ.</p><p>Tốc độ máy được cải thiện đáng kể khi chạy song song 2 ổ cứng với SSD NVMe PCIe tốc độ cao và HDD phổ thông.</p><p>Cổng Lan Gigabit cho tốc độ băng thông lớn đảm bảo cho mọi trải nghiệm internet của bạn. Wifi tiêu chuẩn 802.11ac cho kết nối nhanh, ổn định và tầm kết nối xa hơn.</p>', 30700000, 31500000, 30700000, 2, 0, '2021-03-21 02:40:28', '2021-05-17 08:24:04', 'Laptop Dell Inspiron 15 G3 3500A Core i7-10750H Ram 8GB SSD 512GB, NVIDIA GeForce GTX 1650Ti 4GB 15.6 Inch Full HD 120HZ windown 10 (G3500A .', 'may tinh xach tay Đà Lạt, laptop Đà Lạt, máy tính xách tay Đà Lạt, may tinh xach tay Đà Lạt Dell G3 15 3500A i7 10750H , máy tính xách tay  Dell G3 15 3500A i7 10750H , Dell G3 15 3500A i7 10750H , Dell G3 15 3500A i7 10750H, mua may tinh xach tay', 'Dell G3 15 3500A i7 10750H', 'Dell G3 15 3500A i7 10750H'),
