(149, 3, '31', 'Chuột máy tính không dây Kiwi S190', 'pkc006', '/assets/uploads/products/1616638947_sub_pkc006.3.jpg', '<p class=\"MsoNormal\">Vào những ngày cuối năm chuẩn bị đón Tết Mậu Tuất 2018, công\r\nty cổ phần công nghệ Kiwi Việt Nam sau nhiều thời gian nghiên cứu và phát triển\r\nđã trình làng sản phẩm chuột không dây Kiwi S190 với nhiều ưu điểm vượt trội mà\r\nít dòng chuột không dây nào có thể đáp ứng được. Với thiết kế sang trọng, hiện\r\nđại, kết hợp với pin Kiwi Alkaline dung lượng lớn, điều chỉnh được tốc độ DPI của\r\nchuột, chuột không dây Kiwi S190 xứng đang là lựa chọn hàng đầu hiện nay cho\r\nnhiều thiết bị như máy tính, Android TV Box, Smart tv…<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Thiết kế sang trọng, đẳng cấp<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột không dây Kiwi S190 kết hợp 2 màu đặc trưng đen, xanh\r\ncủa hãng Kiwi, chuột không dây Kiwi S190 được thiết kế mỏng, vừa vặn hơn hẳn cảm\r\ngiác cầm vừa tay và dễ dàng khi di chuyển. Thương hiệu Kiwi được in ngay trên mặt\r\nchuột kết hợp với đường viên xanh bao quanh chuột tăng thêm phần sang trọng, đồng\r\nthời khẳng định sản phẩm của hãng Kiwi trên thị trường.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Logo Kiwi được in nổi và đường viền xanh bao quanh chuột tăng\r\nđộ thẩm mĩ rất cao<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột S190 tương thích với nhiều loại bề mặt khác nhau. Khi\r\ndi chuột trong quá trình dùng, thiết bị sẽ mang lại cảm giác mềm tay, nhẹ nhàng\r\nlướt chuột dễ dàng, với độ nhạy cực cao, hỗ trợ thực hiện các thao tác theo ý\r\nmuốn người dùng.<o:p></o:p></p><p class=\"MsoNormal\">Phía dưới chuột không dây Kiwi S190 có khe gắn cổng USB nhận\r\nchuột, công tắc On/Off tiện lợi bật tắt khi sử dụng, tiết kiệm pin cho người\r\ndùng, đồng thời sẽ có đèn báo sáng để người dùng biết, hiện chuột đang ở trạng\r\nthái hoạt động hay không.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Sử dụng pin Kiwi Alkaline dung lượng lớn, độ bền cao<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Để tăng tính tiện dụng khi sử dụng cũng như đảm bảo thiết bị\r\nkhông gây phiền hà cho người dùng, pin Kiwi Alkaline đang được tích hợp dùng\r\ntrong sản phẩm chuột Kiwi S190 này. Với ưu điểm có dung lượng khá cao hỗ trợ\r\nngười dùng sử dụng bền bỉ với thời gian lâu hơn mà không cần phải thay pin quá\r\nnhiều lần.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Người dùng tùy chỉnh được tốc độ chuột DPI<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Ngay trên mặt chuột người dùng có thể nhận thấy 1 nút DPI nhỏ\r\ngiữa chuột, đây chính là điểm khác biệt lớn nhất giữa chuột không dây Kiwi S190\r\nvà các dòng chuột khác. Người dùng có thể tùy chỉnh được tốc độ con chuột DPI\r\nnhanh chậm tùy người dùng với tốc độ lên tới 1500 DPI giúp cho người dùng có thể\r\nchơi game, làm việc mà cần tốc độ di chuột nhanh. Tốc độ con chuột nhanh hay chậm\r\ntùy vào từng người dùng khác nhau để điều chỉnh cho phù hợp.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Nút chỉnh tốc độ chuột DPI màu xanh nổi bật giúp người dùng dễ\r\ndàng chỉnh theo ý muốn<o:p></o:p></span></i></b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Chuột không dây Kiwi S190 sử dụng với nhiều thiết bị với ưu\r\nđiểm không dây cùng nhiều điểm cải tiến vượt bậc, đây là dòng sản phẩm có chất\r\nlượng cao và được nhiều khách hàng tin dùng với các thiết bị khác trong nhà.<o:p></o:p></p>', 80000, 160000, 110000, 20, 0, '2021-03-21 16:26:37', '2021-05-17 08:07:04', 'Chuột không dây Kiwi S190, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột không dây, chuột wireless, phụ kiện', 'Chuột không dây Kiwi S190', 'Chuột không dây Kiwi S190'),
(150, 3, '31', 'Chuột quang gaming có dây MotoSpeed F405 Led 7 Màu (Đen)', 'pkc008', '/assets/uploads/products/1616383287_sub_pkc008.3.jpg', '<p><b style=\"font-size: 0.875rem;\"><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Thiết kế dành riêng cho game thủ</span></i></b><br></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Motospeed F405 có thiết kế nhỏ gọn, vừa tay mang đến cho bạn\r\ncảm giác thoải mái tối đa khi sử dụng cũng như giúp bạn dễ dàng mang theo bên\r\nmình. Bên cạnh đó, với F405, nhu cầu chơi game của các game thủ cũng được đáp ứng\r\ntối đa nhờ chip dành riêng cho game và thiết kế chống trượt cùng hệ thống đèn\r\nLED độc đáo.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Cảm biến quang học hiện đại<o:p></o:p></span></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột được trang bị cảm biến quang học 1000 DPI mang đến khả\r\nnăng di chuyển mượt mà trên nhiều bề mặt. Bên cạnh đó, phần dây tín hiệu dài\r\n1.5m cũng mang đến sự tiện dụng tối đa cho bạn khi sử dụng.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Tối ưu hóa chất lượng<o:p></o:p></span></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Motospeed F405 được thiết kế với Teflon Feet chất lượng cao\r\ngiúp sản phẩm bền bỉ suốt quá trình sử dụng. Bên cạnh đó, nhờ công nghệ tiên tiến,\r\nchuột cũng được cam kết độ bền lên đến 5 triệu lần click giúp bạn yên tâm hơn\r\nkhi dùng.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;mso-bidi-font-size:13.0pt;\r\nline-height:150%\">Kết nối dễ dàng qua cổng USB<o:p></o:p></span></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột được trang bị cổng USB tiện dụng. Bạn có thể dễ dàng kết\r\nnối với tất cả các loại PC và laptop nhanh chóng mà không cần các thao tác cài\r\nđặt rắc rối.<o:p></o:p></p><p><br></p>', 140000, 250000, 180000, 20, 0, '2021-03-21 16:31:14', '2021-05-17 08:07:34', 'Chuột quang gaming có dây MotoSpeed F405 Led 7 Màu (Đen), chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột có dây, phụ kiện, chuột gaming', 'Chuột quang gaming có dây MotoSpeed F405 Led 7 Màu (Đen)', 'Chuột quang gaming có dây MotoSpeed F405 Led 7 Màu (Đen)'),
(151, 3, '31', 'Chuột máy tính Newmen M180', 'pkc007', '/assets/uploads/products/1616369982_sub_pkc007.3.jpg', '<p><span style=\"font-size: 0.875rem;\">Chuột máy tính Newmen M180 là dòng chuột giá rẻ, chất lượng\r\nrất tốt, cực kì bền và rất mượt trên mọi bề mặt, dành cho phòng game tầm thấp\r\nvà trung.</span><br></p><p class=\"MsoNormal\"><o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột quang có dây 3 nút điều khiển, độ phân giải 1000 DPI.\r\nCông nghệ cảm biến quang.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Phù hợp với nhiều đối tượng sử dụng: Văn phòng, Game, PC hay\r\nLaptop cũng đều ổn cả.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Thiết kê Ergonomic. Thiết kế chạy dài lòng bàn tay, không\r\nquá cao tránh sự khó chịu khi sử dụng lâu dài.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Độ nhạy và độ chính xác định vị quang học. Công nghệ cảm biến\r\nquang mới nhất của Newmen, di chuyển dễ dàng trên nhiều bề mặt.<o:p></o:p></p><p><br></p>', 80000, 160000, 120000, 20, 0, '2021-03-21 16:39:42', '2021-05-17 08:07:15', 'Chuột máy tính Newmen M180 chuột giá rẻ, chất lượng rất tốt, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột có dây, phụ kiện', 'Chuột máy tính Newmen M180 chuột giá rẻ, chất lượng rất tốt', 'Chuột máy tính Newmen M180 chuột giá rẻ, chất lượng rất tốt'),
(152, 3, '31', 'Chuột có dây DAREU LM103', 'pkc009', '/assets/uploads/products/1616634307_sub_pkc009.3.jpg', '<p><span style=\"font-size: 0.875rem;\">Chuột có dây DareU LM103 1000DPI sở hữu vẻ ngoài màu đen mạnh\r\nmẽ, sang trọng nhưng không kém phần mạnh mẽ cá tính với những đường cong, bo\r\ntròn vừa vặn tay cầm... Thiết kế đảm bảo cho game thủ trải nghiệm cảm giác chơi\r\ngame một cách hiệu quả.</span><br></p><p class=\"MsoNormal\"><o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Ngoài ra các phím bấm của chuột được bố trí hợp lý để bạn có\r\nthể sử dụng chuột một cách tốt nhất. Cùng với độ phân giải lên đến 1600DPI giúp\r\nchuột được hoạt động chính xác hơn ngay cả khi chơi game…<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột Chơi Game DareU LM103 có sợi dây cáp khá dài 1,8 mét\r\ncùng cấu tạo đặc biệt giúp bạn thoải mái trong việc di chuyển cũng như việc nhận\r\ntín hiệu chính xác và trung thực khi chơi game. Sản phẩm kết nối máy tính thông\r\nqua cổng USB thông dụng.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Kết nối đơn giản chỉ cần cắm đầu USB vào thiết bị laptop hay\r\nmáy tính bàn đã có thể sử dụng chuột mà không cần bất cứ phần mềm ngoài. Độ bền\r\nlên đến 10 triệu click, bạn sẽ an tâm khi sử dụng sản phẩm.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột máy tính DareU LM103 được trang bị con lăn tiện lợi,\r\ngiúp bạn có thể đọc các tin tức hay làm việc một cách mượt mà và trơn tru hơn với\r\nnhững thao tác lăn nhẹ.<o:p></o:p></p><p><br></p>', 80000, 180000, 120000, 20, 0, '2021-03-21 17:20:38', '2021-05-17 08:06:18', 'Chuột có dây DAREU LM103, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột có dây, phụ kiện', 'Chuột có dây DAREU LM103', 'Chuột có dây DAREU LM103');
