(153, 3, '31', 'Chuột Không Dây Konig KM919', 'pkc010', '/assets/uploads/products/1616381680_sub_pkc010.3.jpg', '<p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Thiết\r\nkế vừa vặn<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột Không Dây Konig KM919 mang thiết kế truyền thống cho cảm\r\ngiác cầm tay vừa vặn, thoải mái trong việc di chuyển cũng như hỗ trợ các chức\r\nnăng giảng dạy, học tập và làm việc.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Độ\r\nphân giải lên đến 1000DPI<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột được trang bị công nghệ chuột quang tiên tiến cho độ\r\nphân giải lên đến 1000DPI. Độ phân giải cao giúp chuột có thể di chuyển nhanh\r\nvà mượt mà trên nhiều bền mặt, đảm bảo hiệu quả cho công việc, học tập cũng như\r\ngiải trí.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Công\r\nnghệ không dây 2.4GHz tiến tiến<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột được trang bị công nghệ kết nối không dây tiên tiến\r\n2.4GHz có độ tin cậy cao. Công nghệ này đảm bảo kết nối liên tục giữa chuột và\r\nmáy tính, cho phép dữ liệu được truyền tải chính xác, không bị gián đoạn và\r\nnhanh hơn 60% so với công nghệ cũ trước đây.<o:p></o:p></p><p class=\"MsoNormal\"><b><i><span style=\"font-size:15.0pt;line-height:107%\">Thời\r\ngian sử dụng pin lâu<o:p></o:p></span></i></b></p><p class=\"MsoNormal\">Chuột sử dụng nguồn năng lượng từ pin AA cùng công nghệ\r\nquang ẩn giúp kéo dài tuổi thọ pin. Chuột có thể hoạt động liên tục lên đến 12\r\ntháng, giúp bạn tiết kiệm chi phí hơn và không còn lo lắng công việc bị gián đoạn\r\ngiữa chừng.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>', 80000, 180000, 120000, 20, 0, '2021-03-21 19:54:40', '2021-05-17 08:06:34', 'Chuột Không Dây Konig KM919, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột không dây, chuột wireless, phụ kiện', 'Chuột Không Dây Konig KM919', 'Chuột Không Dây Konig KM919'),
(154, 3, '31', 'Chuột Quang Có Dây Motospeed F12', 'pkc011', '/assets/uploads/products/1616381939_sub_pkc011.4.jpg', '<p class=\"MsoNormal\">Chuột Quang Có Dây Motospeed F12 - Hàng Nhập Khẩu là dòng sản\r\nphẩm bình dân hướng đến người dùng gia đình hoặc văn phòng với thiết kế đơn giản\r\ndễ sử dụng, chất liệu vỏ tốt, màu đen bóng, cảm biến quang cho độ chính xác\r\ncao, kích thước nhỏ gọn.<o:p></o:p></p><p class=\"MsoNormal\">Thiết kế con lăn 3D chống trượt.<o:p></o:p></p><p class=\"MsoNormal\">Kiểu dáng phù hợp cho cả người thuận trái và phải.<o:p></o:p></p><p class=\"MsoNormal\">DPI lên đến 1000dpi.<o:p></o:p></p><p class=\"MsoNormal\">Dây tín hiệu dài 1.5m.<o:p></o:p></p><p class=\"MsoNormal\">Thiết kế bức xạ thấp, không ảnh hưởng sức khỏe.<o:p></o:p></p><p class=\"MsoNormal\">Độ bền: 5 triệu lần click.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Chip điều khiển riêng dành cho game.<o:p></o:p></p>', 80000, 180000, 130000, 20, 0, '2021-03-21 19:58:59', '2021-05-17 08:07:24', 'Chuột Quang Có Dây Motospeed F12, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột có dây, phụ kiện', 'Chuột Quang Có Dây Motospeed F12', 'Chuột Quang Có Dây Motospeed F12'),
(155, 3, '29', 'SSD Nectac N535V 128GB SATA III 6GB/s', 'pkocs001', '/assets/uploads/products/1616530868_sub_pkocs001.2.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Netac – Một trong những Công Ty đầu tiên phát minh ra những chiếc\r\nUSB 8GB với hơn 300 Bằng Sáng Chế tại Mỹ , Singapore , Hàn Quốc.</span><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Dẫn đầu thị trường USB, Thẻ Nhớ, SSD tại Trung Quốc, những chiếc\r\nSSD Netac với Tốc Độ Cao đi kèm Chất Lượng không thể tốt hơn nay đã có mặt tại\r\nNetac Việt Nam.</span><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Thiết kế</span></i></b><span style=\"font-size:13.0pt;mso-bidi-font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Ổ cứng SSD 128G Netac N535V Sata III 6Gb/s sở hữu thiết kế thon\r\ngọn của dòng SSD Sata III với toàn thân được làm bằng kim loại , kích thước cực\r\nkỳ nhỏ gọn chỉ với 2.5 inch, dễ dàng lắp ráp và cài đặt với hầu hết PC và\r\nLaptop trên thị trường.</span><span style=\"font-size:13.0pt;mso-bidi-font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Dung lượng</span></i></b><span style=\"font-size:13.0pt;mso-bidi-font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Ổ cứng SSD 128G Netac N535V Sata III 6Gb/s có dung lượng 128G,\r\nngười dùng có thể thoải mái lưu trữ nhiều thông tin. Ngoài ra, đối với nhiều\r\nngười dùng còn có thể dùng để làm ổ cài các ứng dụng, game để khởi động tốt\r\nhơn, nhanh hơn tránh khoảng thời gian chờ mà ổ cứng HDD hiện có.</span><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Tốc độ cao</span></i></b><span style=\"font-size:13.0pt;mso-bidi-font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Những sản phẩm Thẻ Nhớ và SSD đến từ Netac luôn được biết đến với\r\nTốc Độ Cao đi kèm Nhiệt Độ ổn định, Trải Nghiệm Thực Tế cho Tốc Độ Đọc vào\r\nkhoảng ~525Mb/s , Ghi vào khoảng ~505Mb/s . Đây sẽ là trợ thủ Đắc Lực dành cho\r\nnhững chiếc PC hoặc Laptop của anh em trong quá trình hoạt động.</span><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Chip điều khiển và flash</span></i></b><span style=\"font-size:\r\n13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Dòng ổ cứng SSD thông thường bao gồm một chip điều khiển và flash.\r\nTrong khi đó flash chiếm 80 – 90% chi phí. Như vậy sẽ rất tốn kém, do đó Netac\r\nđã sử dụng flash MLC đem lại hiệu quả sử dụng cao.</span><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Khả năng làm việc</span></i></b><span style=\"font-size:13.0pt;\r\nmso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Làm việc trong môi trường có nhiệt độ từ 0 độ C – 70 độ C. Điều\r\nnày cho phép bạn có thể sử dụng và làm việc lâu hơn, tránh hiện tượng quá tải,\r\nmáy bị đơ, lag hay sập nguồn đột ngột gây ảnh hưởng đến hiệu quả làm việc.</span><span style=\"font-size:13.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p>', 480000, 720000, 560000, 20, 0, '2021-03-21 20:07:59', '2021-05-17 08:17:01', 'SSD Nectac N535V 128GB SATA III 6GB/s, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Ổ cứng, ổ cứng ssd, ssd, phụ kiện', 'SSD Nectac N535V 128GB SATA III 6GB/s', 'SSD Nectac N535V 128GB SATA III 6GB/s'),
(156, 51, '57', 'Màn Hình LG 24\" 24MP59G (1920x1080/IPS/75Hz/5ms/FreeSync)', '24MP59G', '/assets/uploads/products/1616383017_sub_24MP59G.Background (1).png', '<h3 dir=\"ltr\" style=\"margin-top: 1.75em; margin-bottom: 0.75em; font-size: 28px; color: rgb(61, 70, 77); font-family: Roboto, sans-serif;\"><h4 style=\"text-align: justify; \"><h3><span style=\"font-family: Arial;\">Sơ lược sản phẩm</span></h3><span style=\"font-family: Arial; font-weight: normal;\">Trong phân khúc giá rẻ và phổ thông, thực sự không nhiều chiếc\r\nmàn hình có hiệu năng tốt như LG 24\'\' 24MP59G-P. Một chiếc màn hình được tối ưu\r\nhóa trong tầm giá khoảng 3 triệu đồng cho game thủ từ mẫu mã cho đến tính năng.\r\nBài viết dưới đây mời quý vị và các bạn cùng Phong Vũ tìm hiểu về LG 24\'\'\r\n24MP59G-P- chiếc màn hình đáng mua nhất cho game thủ phân khúc phổ thông!</span></h4><span style=\"font-family: Arial; font-weight: normal;\">\r\n\r\n</span><p class=\"MsoNormal cc_cursor\" style=\"text-align: justify; \"><o:p></o:p></p></h3><h3 dir=\"ltr\" style=\"text-align: justify; margin-top: 1.75em; margin-bottom: 0.75em; font-size: 28px; color: rgb(61, 70, 77); font-family: Roboto, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\"><img alt=\"Màn hình IPS LG 24\" fhd=\"\" 75hz=\"\" 24mp59g-p=\"\" (16:9=\"\" hdmi=\"\" displayport=\"\" headphone=\"\" out=\"\" 75hz-5ms)\"=\"\" src=\"https://phongvu.vn/media/wysiwyg/tekshop/ManHinh/1/DAS-desktop.jpg\" class=\"img-fluid cc_cursor\"></span></h3><h4 style=\"margin-top: 1.75em; margin-bottom: 0.75em;\"><div style=\"text-align: justify;\"><font face=\"Roboto, sans-serif\"><span style=\"font-size: 28px;\"><br></span></font></div><h4 style=\"color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 28px;\"><h3 style=\"text-align: justify; \">Tổng quan thiết kế</h3><span style=\"font-weight: normal;\"><div style=\"text-align: justify;\">Hàng loạt các công nghệ và tính năng nổi bật được nhà sản xuất\r\n“khoe” hết ra vỏ hộp như AMD FreeSync, Response time 1ms, Black Stabilizer,\r\nDynamic Action Sync… (các tính năng này cụ thể như nào mình sẽ giải thích phía\r\ndưới).</div><div style=\"text-align: justify;\">Qua cái nhìn tổng thể, màn hình LG 24\'\' 24MP59G-P có thiết kế\r\nrất thân quen với viền màn hình dày bám vào phía trong, 4 góc bo tròn nhưng vẫn\r\ncứng cáp. Tuykhông đáp ứng được trải nghiệm hình ảnh không viền như chúng bạn “\r\nđồng trang lứa” - VX2476-SMHD của VIEWSONIC hay 24MP88HV của LG, nhưng bù&nbsp; lại LG 24\'\' 24MP59G-P xuất hình ảnh chạm viền\r\nchứ không có những khoảng đen cạnh viền như các màn hình không viền khác.</div></span></h4></h4><p dir=\"ltr\" style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><o:p></o:p></p><h3 dir=\"ltr\" style=\"text-align: justify; margin-top: 1.75em; margin-bottom: 0.75em; font-size: 28px; color: rgb(61, 70, 77); font-family: Roboto, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\"><img alt=\"Màn hình IPS LG 24\" fhd=\"\" 75hz=\"\" 24mp59g-p=\"\" (16:9=\"\" hdmi=\"\" displayport=\"\" headphone=\"\" out=\"\" 75hz-5ms)\"=\"\" src=\"https://phongvu.vn/media/wysiwyg/tekshop/ManHinh/1/Black_Stabilizer-desktop.jpg\" class=\"img-fluid cc_cursor\"></span></h3><h4><div style=\"text-align: justify;\"><span style=\"font-weight: normal; color: inherit; font-family: inherit;\">Phía sau lưng màn hình vẫn là một bảng màn hình mỏng gắn\r\ncùng với một thanh dày phía sau. Trên thanh dày có bố trí đầy đủ các cổng kết nối\r\ncần thiết như nguồn, VGA, HDMI, D-port và jack tai nghe 3.5.</span></div><h4><div style=\"text-align: justify;\"><span style=\"font-weight: normal; color: inherit; font-family: inherit;\">&nbsp;</span></div><span style=\"font-weight: normal;\"><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Tiếp đến là phần chân đế, có thể nói phần chân đế được thiết\r\nkế như một lời tuyên bố chắc nịch: “đây là sản phẩm gaming”. Với kiểu dáng góc\r\ncạnh mạnh mẽ cộng thêm cách phối màu đỏ đem đậm chất game thủ, chưa nói về hiệu\r\nnăng, phần thiết kế đẹp đã quá xứng đáng để “trang hoàng” góc chơi game của bạn\r\nrồi. Đã đẹp còn thực dụng, chân đế dáng chữ V nên trọng lực được phân tán đều\r\ntrên 3 điểm rất vững vàng. Cột của chân đế hướng về phía trước có thể hiệu chỉnh\r\nđộ nghiêng màn hình tùy theo vóc dáng người dùng.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Về phần điều khiển của màn hình LG 24\'\' 24MP59G-P, cũng giống\r\nnhư các phần lớn anh em trong nhà LG, tối giản và tiện lợi với nút cần gạt thiết\r\nkế chìm chính giữa cạnh đáy màn hình rất nhạy và độ phản hồi cao.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Cạnh dưới của đáy có in logo LG quen thuộc ở chính giữa, và\r\ndòng chữ IPS LED&nbsp; ở góc trái để nhấn mạnh\r\nrằng đây là một chiếc màn hình có tấm nền IPS cao cấp và dùng đèn nền LED siêu\r\nsáng, siêu tiết kiệm điện.</span></div></span></h4></h4><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p dir=\"ltr\" style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><o:p></o:p></p><h3 dir=\"ltr\" style=\"text-align: justify; margin-top: 1.75em; margin-bottom: 0.75em; font-size: 28px; color: rgb(61, 70, 77); font-family: Roboto, sans-serif;\"><span style=\"color: rgb(0, 0, 0);\"><img alt=\"Màn hình IPS LG 24\" fhd=\"\" 75hz=\"\" 24mp59g-p=\"\" (16:9=\"\" hdmi=\"\" displayport=\"\" headphone=\"\" out=\"\" 75hz-5ms)\"=\"\" src=\"https://phongvu.vn/media/wysiwyg/tekshop/ManHinh/1/gamemodefinal.jpg\" class=\"img-fluid\"></span></h3><h3 style=\"text-align: justify; \">Hiệu năng và trải nghiệm</h3><p class=\"MsoNormal\"><o:p></o:p></p><h4><div style=\"text-align: justify;\"><span style=\"font-weight: normal; color: inherit; font-family: inherit;\">&nbsp;</span></div><span style=\"font-weight: normal;\"><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Qua thử nghiệm một số game, đặc biệt là CS:GO thì LG 24MP59G\r\ncho cảm giác chơi khá mượt mà, tuy không thể bằng được các màn hình 144Hz song\r\nvẫn tuyệt vời, các game thủ không chuyên chắc chắn là chẳng nhận ra nhiều khác\r\nbiệt. Đơn giản bởi với thời gian đáp ứng nhanh 1ms và tần số quét được tăng lên\r\nmột chút 75Hz thì chất lượng khung hình thực sự là rất tốt. Trải nghiệm thực\r\ncòn tuyệt hơn với các cộng nghệ dưới đây.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Đa dạng các tính năng chơi game: Chế độ DAS</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Bằng cách giảm tối thiểu độ trễ của màn hình, chế độ Đồng bộ\r\nhóa chuyển động Dynamic Action Sync cho phép người chơi tấn công đối thủ thức\r\nthì trong nháy mắt, đem đến một trải nghiệm siêu thực như đang sống trong từng\r\nkhung cảnh của các dòng game hành động cảm giác mạnh.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p></span><h3 style=\"text-align: justify; \">Chế độ Game Mode</h3><span style=\"font-weight: normal;\"><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Đơn giản thiết lập Chế độ Chơi game trong khi đang ở Chế độ\r\nHình ảnh, bạn sẽ tùy chỉnh được chất lượng hình ảnh mong muốn cho các kiểu game\r\nkhác nhau như: FPS Game1, FPS Game2, RTS Game và Custome Game.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Chuyển động mượt mà với 1ms Motion Blur Reduction</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Thời gian đáp ứng là cực kỳ quan trọng giúp các hình ảnh\r\nchuyển động mượt mà và không bị hiện tượng lưu ảnh. Công nghệ 1ms Blur Motion\r\nReduction cho phép hình ảnh hiển thị và chuyển động sắc nét trong các tình huống\r\ngame khác nhau, thỏa mãn yêu cầu trải nghiệm game trọn vẹn cho người chơi.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p></span><h3 style=\"text-align: justify; \">Công nghệ AMD FreeSync</h3><span style=\"font-weight: normal;\"><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Ở các màn hình không được tích hợp công nghệ AMD FreeSync,\r\nkhi chơi các game đỉnh ở setting cao khung hình của bạn sẽ bị giằng xé không\r\nthương tiếc khiến trải nghiệm bị gián đoạn. Nhưng với AMD FreeSync, không còn\r\nhiện tượng mất khung hình khi chơi game, công nghệ này loại bỏ hiện tượng giật,\r\nxé hình xảy ra do sự khác biệt giữa tốc độ xử lý khung hình của card đồ họa và\r\ntần số làm tươi của màn hình. Chuyển động nhân vật trong game và trên màn\r\nhìnhmáy tính sẽ mượt mà hơn khi bạn chọn chế độ cài đặt hình ảnh cao nhất.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Cân bằng tối Black Stabilizer</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Đối với các dòng game bắn súng, tính năng Black Stabilizer sẽ\r\nmang đến lợi thế to lớn cho game thủ bằng cơ chế tự động cảm nhận các vùng tối\r\nvà tăng cường độ sáng tại những vị trí đó. Người chơi sẽ có được một tầm nhìn\r\nrõ ràng ngay cả ở các khung cảnh thiếu sáng nhất và dễ dàng nhận ra vị trí kẻ\r\nthù đang ẩn nấp hay phục kích.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p></span><h3 style=\"text-align: justify; \">Hiển thị nhiều tác vụ với chế độ Screen Split</h3><span style=\"font-weight: normal;\"><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Phần mềm OnScreen Control cho phép bạn tự do lựa chọn các\r\ncài đặt màn hình phù hợp trong số 14 tùy chọn của chức năng\r\n\"ScreenSplit\" để tối ưu khả năng xử lý đa nhiệm của Windows và không\r\ngian làm việc trên màn hình.</span></div><o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">&nbsp;</span></div></o:p><div style=\"text-align: justify;\"><span style=\"color: inherit; font-family: inherit;\">Với tính năng Tách màn hình, bạn có thể chia màn hình thành\r\nnhiều cửa sổ khác nhau để phục vụ cho công việc. Chế độ PIP tích hợp giúp bạn vừa\r\nlàm việc vừa có thể xem video trên một cửa sổ nhỏ ngay trên màn hình.</span></div></span></h4><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p dir=\"ltr\" style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><o:p></o:p></p>', 3190000, 3500000, 3190000, 10, 0, '2021-03-21 20:16:57', '2021-03-21 20:19:16', 'Màn Hình LG 24\" 24MP59G (1920x1080/IPS/75Hz/5ms/FreeSync)', 'Màn Hình LG 24\" 24MP59G (1920x1080/IPS/75Hz/5ms/FreeSync)', 'Màn Hình LG 24\" 24MP59G (1920x1080/IPS/75Hz/5ms/FreeSync)', 'Màn Hình LG 24\" 24MP59G (1920x1080/IPS/75Hz/5ms/FreeSync)'),
