td><td width=\"389\">5ms</td></tr><tr><td width=\"180\">Góc nhìn</td><td width=\"389\">178°/178°</td></tr><tr><td rowspan=\"3\" width=\"180\">Kích thước</td><td width=\"389\">539.2 x 322.8 x 39.4 mm&nbsp;(Không chân đế)</td></tr><tr><td width=\"389\" rowspan=\"2\">539.2 x 425.3 x 232.0 mm&nbsp;(Gồm chân đế)</td></tr><tr></tr><tr><td rowspan=\"3\" width=\"180\">Cân nặng</td><td width=\"389\">2.6 kg (Không chân đế)</td></tr><tr><td width=\"389\" rowspan=\"2\">2.9 kg (Gồm chân đế)</td></tr><tr></tr><tr><td width=\"180\">Phụ kiện</td><td width=\"389\">Cáp nguồn, Cáp&nbsp;HDMI, Hướng dẫn sử dụng,…</td></tr></tbody></table><p style=\"margin-bottom: 0px; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">&nbsp;</p>', 3400000, 3500000, 3400000, 10, 0, '2021-03-21 20:43:28', '2021-03-21 20:43:28', 'Màn Hình Samsung LF24T370 75Hz (24 inch, 1920 x 1080, 75Hz, IPS, 5ms)', 'Màn Hình Samsung LF24T370 75Hz (24 inch, 1920 x 1080, 75Hz, IPS, 5ms)', 'Màn Hình Samsung LF24T370 75Hz (24 inch, 1920 x 1080, 75Hz, IPS, 5ms)', 'Màn Hình Samsung LF24T370 75Hz (24 inch, 1920 x 1080, 75Hz, IPS, 5ms)'),
(161, 51, '57', 'Màn hình LG 20M39H/20MK400H-B 20\" có HDMI', '20M39H', '/assets/uploads/products/1616401047_sub_20M39H.Background.png', '<h2 style=\"margin-bottom: 0.75em; font-size: 32px; color: rgb(61, 70, 77); font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\"><span style=\"font-size: x-large;\">Màn hình LG 20M39H/20MK400H-B 20\" có HDMI</span></span></h2><p style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">Model:&nbsp;20M39H-B<br>Kích thước:&nbsp;19.5 inch<br>Độ phân giải:&nbsp;&nbsp;1600 x 900<br>Tấm nền:&nbsp;IPS<br>Góc nhìn:&nbsp;178/178<br>Độ sáng:&nbsp;200&nbsp;nits<br>Thời gian đáp ứng:&nbsp;5ms<br>Cổng kết nối:&nbsp;VGA, HDMI</p><p><span style=\"color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">Màn hình LG 20M39H/MK400H-B 20\" có HDMI</span></p><p style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">Bảo vệ đôi mắt và chế độ xem thoải mái<br>Bạn có biết rằng đôi mắt của bạn bị ảnh hưởng bởi nhấp nháy trên màn hình trong khi bạn có thể đã không nhìn thấy chúng? Theo thời gian, làm việc, chơi game và xem phim có thể gây ra căng thẳng mắt và mệt mỏi. Tuy nhiên, chế độ Flicker Safe and Reader giúp tối đa hóa sự thoải mái bằng mắt bằng cách bảo vệ mắt khỏi ánh sáng màu xanh độc hại và giảm mức nhấp nháy xuống gần như bằng không.</p><p style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">Tùy chọn Tuỳ chỉnh Đã Đặt trước với chỉ một cú nhấp chuột<br>OnScreen Control cho phép bạn sửa đổi cấu hình màn hình của bạn bằng một vài cú nhấp chuột mà không cần nhấn&nbsp;các nút vật lý được xây dựng trong màn hình. Cài đặt hiển thị của tôi cung cấp chế độ hình ảnh tùy chỉnh cho phần mềm cụ thể. Nó đã tự động áp dụng cho chế độ hình ảnh mà bạn đã cài sẵn. Bạn không cần phải chọn chế độ hình ảnh mỗi lần.</p><p style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">Tùy chỉnh không gian làm việc của bạn cho đa nhiệm<br>Screen Split chia màn hình thành nhiều phần cho các tác vụ khác nhau bằng cách thay đổi kích thước cửa sổ trên màn hình. Các tùy chọn nâng cao của nó đã được mở rộng để bao gồm 4 kiểu Picture-in-Picture (PIP) trong 14 lựa chọn. Với chế độ PIP, bạn có thể làm việc trên màn hình chính trong khi xem một video trong một cửa sổ nhỏ hơn nổi trên màn hình.</p><p style=\"margin-bottom: 1.5em; color: rgb(61, 70, 77); font-family: Roboto, sans-serif; font-size: 16px;\">Cung cấp Tầm nhìn Màu cải tiến đến Điểm yếu Màu<br>Các thuật toán sửa đổi màu sắc được sử dụng để giúp những người có điểm yếu màu sắc gặp khó khăn khi phân biệt các dải màu nhất định có thể xem tất cả nội dung quan trọng.</p>', 1990000, 2500000, 1990000, 10, 0, '2021-03-22 01:17:27', '2021-03-22 01:17:27', 'Màn hình LG 20M39H/20MK400H-B 20\" có HDMI', 'Màn hình LG 20M39H/20MK400H-B 20\" có HDMI', 'Màn hình LG 20M39H/20MK400H-B 20\" có HDMI', 'Màn hình LG 20M39H/20MK400H-B 20\" có HDMI'),
