(170, 3, '23', 'Ốp lưng silicon dẻo trong suốt iPhone XS Max', 'iPhone XS Max', '/assets/uploads/products/1616493452_sub_iPhone XS Max.Background.png', '<p>Ốp lưng silicon dẻo trong suốt chống sốc iPhone XS Max chất liệu TPU dày 0.9 mm, mềm dẻo, trong suốt, có độ đàn hồi cao, có thể bóp lại, cuộn lại mà không biến dạng. Ốp lưng được thiết kế với 4 góc dày dặn hơn (hầu hết khi rơi máy các góc sẽ va chạm đầu tiến), kết hợp với phần khung viền từ nhựa dẻo TPU cao cấp khá dầy dặn (~1mm), phần tiếp xúc với cạnh máy có làm thêm các đường gân không những giúp cho ốp cầm chắc tay hơn mà còn tăng khả năng đàn hồi, bảo vệ toàn bộ máy luôn an toàn trước mọi va chạm, mặt lưng còn 4 chấu nhỏ nhô cao để nâng phần lưng của máy lên khi để lên bàn hạn chế xước Camera sau của máy. Mọi chi tiết hoàn thiện của ốp lưng đều làm rất đẹp, các vết cắt mịn, đều. Các phím bấm được làm nổi giúp thao tác dễ dàng..<br></p>', 59000, 80000, 59000, 10, 0, '2021-03-23 02:57:32', '2021-03-23 02:57:32', 'Hàng chính hãng Nillkin Chất liệu Silicon có độ đàn hồi tốt. Thiết kế siêu mỏng với độ dày chỉ 0.6mm. Ôm sát thân máy, cạnh bên được thiết kế nhám giúp cầm ..', 'op lung iPhone XS Max, ốp lưng iPhone XS Max, op lung iPhone XS Max Da Lat, ốp lưng iPhone XS Max Da La, op lung iPhone XS Max Đà Lạt, ốp lưng iPhone XS Max Đà Lạt', 'Ốp lưng silicon dẻo trong suốt iPhone XS Max', 'Ốp lưng silicon dẻo trong suốt iPhone XS Max'),
(172, 3, '29', 'Ổ cứng SSD ADATA SU800 - 128GB', 'pkocs004', '/assets/uploads/products/1616532911_sub_pkocs004.3.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Adata SU800 sử dụng chuẩn ổ 2.5 inch với độ\r\ndày 7mm, và giao tiếp SATA III 6Gbps.</span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Theo công bố từ nhà sản xuất, SU800 sử dụng\r\nkhối điều khiển SM2258 của Silicon Motion - với bốn kênh flash NAND, tích hợp\r\ncông nghệ sửa lỗi ECC LDPC. Ổ có kích thước 2,5 inch tiêu chuẩn với độ dày 7\r\ninch - phù hợp với các dòng MTXT mỏng mới.</span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Tương tự như các dòng sản phẩm SSD khác, phiên\r\nbản 128GB có tốc độ truy xuất chậm hơn so với các “đàn anh” - chỉ ở mức\r\n300MB/giây (ghi). Phiên bản được đánh giá trong bài viết này là 256GB với hiệu\r\nnăng lý thuyết được ấn định ở ngưỡng 560MB/giây đối với thao tác đọc dữ liệu\r\nliên tục và 520MB/giây đối với thao tác ghi dữ liệu liên tục.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Phiên bản thử nghiệm là loại 256GB và được sản\r\nxuất tại Đài Loan.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Dù Adata không tiết lộ gì về mức tiêu thụ điện\r\ncũng như tần suất truy xuất dữ liệu ngẫu nhiên, khối điều khiển SM2258 của ổ có\r\nchỉ số này ở mức đọc là 90.000 IOPS (truy xuất vào/ra mỗi giây) và ghi là\r\n80.000 IOPS (85.000 IOPS đối với các phiên bản từ 512GB trở lên). Ngoài ra, dù\r\nkhông có chế độ mã hóa AES 256-bit - thứ ít khi hữu dụng với môi trường tiêu\r\ndùng phổ thông, SU800 lại “bù” bằng DevSLP (chế độ nghỉ với khả năng chỉ sử\r\ndụng 12mW mà thôi).</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Do không sử dụng vít bắt, Adata SU800 khá nhẹ\r\nso với các dòng ổ cùng loại.</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Bên trong lớp vỏ kim loại, chip nhớ của SU800\r\ncó kí hiệu NW838 - cho thấy đây là linh kiện của Micron cung cấp (có chất lượng\r\ntốt). Nó cũng cho thấy đây là chip NAND công nghệ TLC 3D với mật độ dữ liệu\r\n768Gb.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Thông số của SU800 trong Adata SSD Toolbox -\r\ntiện ích kèm theo cho phép quản lý các chức năng vận hành.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Hiệu năng thực tế của ổ SSD NAND 3D với SATA\r\nIII</span></b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Để thử nghiệm hiệu năng của ổ, chúng ta sử\r\ndụng các ứng dụng đo điểm phổ biến nhất hiện nay gồm Crystal Disk Mark, ATTO,\r\nHDTune - tất cả đều được chạy ở thiết lập tiêu chuẩn để tiện cho việc so sánh.\r\nHệ thống sử dụng đo điểm là nền tảng Intel, đã kích hoạt đầy đủ AHCI, cài đặt\r\ncác trình điều khiển mới nhất.</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Kết quả cụ thể như sau:</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Kết quả đo điểm SU800 trên Crystal Disk Mark\r\n5.2.0 (phiên bản 64-bit).</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Trong Crystal Disk Mark, điểm số thu được là\r\nrất khả quan với tốc độ đọc/ghi dữ liệu trội hơn một số dòng NAND 3D khác trên\r\nthị trường. Tuy nhiên, hiệu năng đọc dữ liệu ngẫu nhiên 4K có phần thấp hơn một\r\nsố sản phẩm (ví dụ như Samsung 850 Evo) - dù không nhiều, và chắc chắn cũng\r\nkhông thể hiện khác biệt trong sử dụng thực tế. Ngoài ra, sau nhiều vòng chạy,\r\ncũng có thể thấy hiệu năng đọc/ghi dữ liệu của SU800 là khá ổn định, không có\r\nbiến động bất thường.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Kết quả đo điểm bằng ATTO.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Với ATTO, tốc độ đọc dữ liệu liên tục cũng đạt\r\ntới mức 562,7MB/giây - tương đồng với kết quả thu được từ Crystal Disk Mark. Nó\r\nthậm chí nhỉnh hơn chút ít so với mức mà Adata công bố (560MB/giây). Tuy nhiên,\r\ntốc độ ghi dữ liệu lại \"hụt\" đi chút ít - khi chỉ đạt 516,2MB/giây\r\n(mức công bố là 520MB/giây). Dù vậy, mức chênh quá nhỏ này cho thấy ổ vận hành\r\nthực tế rất đúng với công bố.</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Kết quả đo điểm bằng HD Tune.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Kết luận</span></b><span style=\"font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Nhìn chung, không thể phủ nhận Adata SU800 có\r\nhiệu năng rất tốt, vượt trội so với ổ cứng đĩa từ truyền thống, đúng với mức do\r\nnhà sản xuất công bố. Dù vậy, sự chênh lệch các kết quả đo tốc độ đọc/ghi dữ\r\nliệu chưa nổi trội so với mặt bằng chung các ổ TLC cùng phân khúc. Tuy nhiên,\r\nđây là điều dễ hiểu do hầu hết các dòng ổ SSD sử dụng giao tiếp SATA III 6Gbps\r\nhiện nay đều đã tận dụng tối đa mức băng thông của loại kết nối này.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Hiệu năng ngang ngửa ổ SSD NAND 2D, nhưng lại\r\ncó dung lượng lớn hơn, giá rẻ hơn - đó chính là bí quyết tạo ra ưu thế của các\r\nloại SSD với chip NAND 3D.</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Dĩ nhiên, không vì thế mà những sản phẩm SSD\r\nvới chip nhớ NAND 3D như SU800 mất đi sức hấp dẫn của mình trên thị trường. Như\r\nđã đề cập tới phần đầu của bài viết, sự hiện diện của công nghệ mới đã cho phép\r\ncác nhà sản xuất tạo ra những dòng ổ thế hệ mới với chi phí mềm hơn trong khi\r\nlại tăng cường được mức dung lượng. Khi hiệu năng ngang bằng, dĩ nhiên sản phẩm\r\nvới dung lượng lớn, giá rẻ hơn sẽ có sức hấp dẫn không nhỏ với người tiêu dùng\r\n- đặc biệt là ở phân khúc phổ thông mà chính SU800 đang nhắm tới.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Như thế, nói một cách chung nhất, với tất cả\r\nnhững gì đã thể hiện, chắc chắn các dòng SSD với chip NAND 3D - mà Adata SU800\r\nlà điển hình - sẽ sớm trở thành lựa chọn đại trà trên thị trường công nghệ\r\ntrong và ngoài nước thời gian tới. Dù có mức giá rẻ hơn, chúng cũng sẽ không\r\nthua kém các dòng sản phẩm SSD trước đó về hiệu năng cũng như tuổi thọ (thậm\r\nchí còn trội hơn) - điều hứa hẹn sẽ đem tới cho người tiêu dùng giải pháp lưu\r\ntrữ \"ngon, bổ, rẻ\" hơn bao giờ hết.</span><span style=\"font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p>', 490000, 790000, 580000, 20, 0, '2021-03-23 13:55:11', '2021-03-23 13:55:11', 'Ổ cứng SSD ADATA SU800 - 128GB, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Ổ cứng, ổ cứng ssd, ssd, phụ kiện', 'Ổ cứng SSD ADATA SU800 - 128GB', 'Ổ cứng SSD ADATA SU800 - 128GB'),
