(174, 3, '29', 'Ổ cứng SSD HIKVISION C100 120GB', 'pkocs006', '/assets/uploads/products/1616535802_sub_pkocs006.3.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Ổ cứng SSD HIKVISION mã C100 120GB Sata III</span></b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\"><br>\r\nDòng sản phẩm C100 của loạt Ổ cứng thể rắn được phát triển từ nhiều năm kinh\r\nnghiệm và chuyên môn trên công nghệ lưu trữ và bộ nhớ Flash quản lý. Đây là sản\r\nphẩm chuyên dùng cho tối ưu hóa của hệ điều hành máy tính và cung cấp ổn định\r\nvà nhanh chóng dịch vụ dữ liệu bằng cách gia tốc khởi động và hiệu suất.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Dung lượng lưu trữ 120GB, Giao tiếp SATA III\r\ntương thích nhiều thiết bị</span></b><span style=\"font-size:13.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\"><br>\r\n<b>Ổ Cứng SSD HIKVISION C100</b>&nbsp;được trang bị chuẩn giao tiếp SATA III\r\ncho tốc độ truyền dữ liệu 3Gb/s. Với tốc độ này máy tính của bạn sẽ được vận\r\nhành một cách nhanh chóng nhất.</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Với dung lượng 120GB giúp bạn thoải mái lựa\r\nchọn theo từng nhu cầu cần thiết để lưu trữ hình ảnh, âm nhạc và video thoải\r\nmái và an toàn. Cùng với khả năng truy cập cơ sở dữ liệu của bạn cực nhanh giúp\r\nbạn tiết kiệm thời gian và làm được nhiều việc hơn.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Tốc độ truyền dữ liệu cao</span></b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\"><br>\r\nỔ cứng mang đến cho bạn tốc độ đọc lên tới 550 MB/s và tốc độ ghi lên tới\r\n435MB/s, nhờ đó bạn sẽ xử lý công việc nhanh chóng hơn, mang đến khả năng xử lý\r\ncông việc nhanh chóng, tiết kiệm thời gian. Ngoài ra, tốc độ truyền dữ liệu cao\r\ncòn giúp bạn dễ dàng chơi game, phát lại phương tiện truyền thông HD hoặc phần\r\nmềm sáng tạo.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\">Tiết kiệm điện năng</span></b><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\"><br>\r\nỔ cứng không chỉ cho công suất cao hơn lên đến 120GB mà còn để giúp tiết kiệm\r\nnăng lượng và khởi động máy nhanh hơn nâng cao năng suất làm việc. Ổ cứng\r\nSSD&nbsp;<b>HIKVISION C100&nbsp;</b>còn tương thích với nhiều hệ điều hành như\r\nWindows, Mac OS, Linux... và có thể sử dụng để truyền dữ liệu với nhiều thiết\r\nbị vi tính khác. Sản phẩm dùng cho laptop, máy tính để bàn chạy nhanh hơn</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p>', 490000, 800000, 600000, 20, 0, '2021-03-23 14:43:22', '2021-03-23 14:43:22', 'Ổ cứng SSD HIKVISION C100 120GB, chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Ổ cứng, ổ cứng ssd, ssd, phụ kiện', 'Ổ cứng SSD HIKVISION C100 120GB', 'Ổ cứng SSD HIKVISION C100 120GB'),
