nt-family:\r\n&quot;Times New Roman&quot;;color:black\">Ổ cứng SSD Netac N600S 256Gb SATA III 6Gb/s có\r\ndung lượng 256Gb, người dùng có thể thoải mái lưu trữ nhiều thông tin. Ngoài\r\nra, đối với nhiều người dùng còn có thể dùng để làm ổ cài các ứng dụng, game để\r\nkhởi động tốt hơn, nhanh hơn tránh khoảng thời gian chờ mà ổ cứng HDD hiện có.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b style=\"font-size: 0.875rem;\"><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Tốc độ cao</span></i></b><br></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black\">Những sản phẩm Thẻ Nhớ và SSD đến từ Netac luôn\r\nđược biết đến với Tốc Độ Cao đi kèm Nhiệt Độ ổn định, Trải Nghiệm Thực Tế cho\r\nTốc Độ Đọc vào khoảng ~525Mb/s, Ghi vào khoảng ~505Mb/s.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b style=\"font-size: 0.875rem;\"><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Chip điều khiển và flash</span></i></b><br></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black\">Dòng ổ cứng SSD thông thường bao gồm một chip\r\nđiều khiển và flash. Trong khi đó flash chiếm 80 – 90% chi phí. Như vậy sẽ rất\r\ntốn kém, do đó Netac đã sử dụng flash MLC đem lại hiệu quả sử dụng cao.</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b style=\"font-size: 0.875rem;\"><i><span style=\"font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif;\">Khả năng làm việc</span></i></b><br></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:13.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black\">Làm việc trong môi trường có nhiệt độ từ 0 độ C\r\n– 70 độ C. Điều này cho phép bạn có thể sử dụng và làm việc lâu hơn, tránh hiện\r\ntượng quá tải, máy bị đơ, lag hay sập nguồn đột ngột gây ảnh hưởng đến hiệu quả\r\nlàm việc.</span></p>', 750000, 1000000, 810000, 20, 0, '2021-03-23 15:20:07', '2021-03-23 15:20:07', 'Ổ cứng SSD Netac N600S 256GB SATA III 6GB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Ổ cứng, ổ cứng ssd, ssd, phụ kiện', 'Ổ cứng SSD Netac N600S 256GB SATA III 6GB/s', 'Ổ cứng SSD Netac N600S 256GB SATA III 6GB/s'),
(181, 3, '25', 'Thẻ nhớ Hikvision 16GB C1 Tốc độ 92MB/S', 'pktn001', '/assets/uploads/products/1616538477_sub_pktn001.3.jpg', '<p>Được sản xuất từ thương hiệu HIKVISION – nhà sản xuất số 1 thế giới về Camera, Thẻ nhớ Hikvision 16GB C1 Tốc độ 92MB/S được sản xuất chuyên dùng cho camera, điện thoại, camera hành trình ghi hình 4K,… với tốc độ cao giúp ghi hình ổn định, chống rung.<br></p>', 100000, 160000, 120000, 20, 0, '2021-03-23 15:27:57', '2021-03-23 15:27:57', 'Thẻ nhớ Hikvision 16GB C1 Tốc độ 92MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ Hikvision 16GB C1 Tốc độ 92MB/S', 'Thẻ nhớ Hikvision 16GB C1 Tốc độ 92MB/S'),
(182, 3, '25', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s', 'pktn002', '/assets/uploads/products/1616538671_sub_pktn002.1.jpg', '<p><span style=\"font-size: 0.875rem;\">Thẻ nhớ MicroSD Sandisk Ultra với dung lượng lên tới 16GB,\r\nvì vậy bạn sẽ có rất nhiều không gian để lưu trữ hình ảnh và video của bạn. Và\r\nbạn cũng sẽ không cần phải quan tâm đến việc xóa bất kỳ dữ liệu nào khi vấn đề\r\nvề không gian lưu trữ đã không còn quan trọng.</span><br></p><p class=\"MsoNormal\"><o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Với tốc độ cực nhanh lên đến 80 MB/s, thẻ nhớ MicroSD\r\nSandisk Ultra có thể nhanh chóng di chuyển tất cả hình ảnh và video của bạn từ\r\nđiện thoại hoặc máy tính bảng của bạn để máy tính.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra với tốc độ cao, cho phép bạn\r\nchụp ảnh chất lượng cao và quay video Full HD rất mượt mà.<o:p></o:p></p><p><br></p>', 100000, 200000, 140000, 20, 0, '2021-03-23 15:31:11', '2021-03-23 15:31:11', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s'),
(183, 3, '25', 'Thẻ nhớ Imou ST3-32-S1 32gb', 'pktn003', '/assets/uploads/products/1616543688_sub_pktn003.3.jpg', '<p class=\"MsoNormal\">Được sản xuất từ thương hiệu Imou. Thẻ nhớ Imou&nbsp;32GB C1 Tốc độ 80MB/S được sản xuất\r\nchuyên dùng cho camera, điện thoại, camera hành trình ghi hình 4K,… với tốc độ\r\ncao giúp ghi hình ổn định, chống rung.<o:p></o:p></p>', 120000, 250000, 170000, 20, 0, '2021-03-23 16:54:48', '2021-03-23 16:54:48', 'Thẻ nhớ Imou ST3-32-S1 32gb, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ Imou ST3-32-S1 32gb chính hãng, giá rẻ', 'Thẻ nhớ Imou ST3-32-S1 32gb chính hãng, giá rẻ'),
(184, 3, '25', 'Thẻ Nhớ Micro SD Samsung Evo Plus U1 32GB Class 10 - 95MB/s (Kèm Adapter)', 'pktn004', '/assets/uploads/products/1616544154_sub_pktn004.3.jpg', '<p class=\"MsoNormal\">Thẻ Nhớ Micro SD Samsung Evo Plus U1 32GB Class 10 có tốc độ\r\ntruyền tối đa lên đến 95MB/s - đọc, 20MB/s - ghi giúp bạn tiết kiệm tối đa thời\r\ngian truyền dữ liệu.<o:p></o:p></p><p class=\"MsoNormal\">Với dung lượng lưu trữ 32GB, bạn có thể thoải mái lưu trữ rất\r\nnhiều những dữ liệu, tập tin khác nhau như hình ảnh, âm thanh, video, tài liệu.\r\nGiờ đây, bạn không phải lo lắng vì hết bộ nhớ nữa.<o:p></o:p></p><p class=\"MsoNormal\">Thẻ nhớ tương thích với hầu hết các thiết bị hỗ trợ thẻ\r\nMicro SD hiện nay. Bạn có thể dễ dàng sử dụng để mở rộng không gian lưu trữ cho\r\ncác thiết bị di động như điện thoại, máy nghe nhạc, máy ảnh, máy tính bảng.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Sản phẩm thiết kế chịu được các điều kiện thời tiết khắc\r\nnghiệt đặc biệt có thể tồn tại 72 giờ trong nước biển hay bảo vệ dữ liệu trước\r\ntrước những nguy cơ gây hại từ tia X. Bên cạnh đó, thẻ nhớ còn tuân thủ các\r\ntiêu chuẩn nghiêm ngặt trong việc chống sốc, chống rung, tính ổn định cao. Đồng\r\nthời, trọng lượng cực nhẹ và vô cùng nhỏ gọn, bạn có thể mang theo thẻ nhớ và sử\r\ndụng ngay khi cần.<o:p></o:p></p>', 200000, 320000, 250000, 20, 0, '2021-03-23 17:02:34', '2021-03-23 17:02:34', 'Thẻ Nhớ Micro SD Samsung Evo Plus U1 32GB Class 10 - 95MB/s (Kèm Adapter), hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ Nhớ Micro SD Samsung Evo Plus U1 32GB Class 10 - 95MB/s (Kèm Adapter)', 'Thẻ Nhớ Micro SD Samsung Evo Plus U1 32GB Class 10 - 95MB/s (Kèm Adapter)'),
(185, 3, '25', 'Thẻ Nhớ MicroSD 64Gb DSS Class 10 Up To 80Mb/s', 'pktn005', '/assets/uploads/products/1616544449_sub_pktn005.3.jpg', '<p class=\"MsoNormal\">Hỗ trợ ghi hình tốc độ cao, tương thích với nhiều hệ điều\r\nhành khác nhau.<o:p></o:p></p><p class=\"MsoNormal\">Hỗ trợ quay video HD và chụp liên tục.<o:p></o:p></p><p class=\"MsoNormal\">Ghi hình liên tục (24/24)<o:p></o:p></p><p class=\"MsoNormal\">Áp dụng cho: Camera ip, camera hành trình, điện toại, máy\r\ntính bảng…<o:p></o:p></p><p class=\"MsoNormal\">Hiệu suất cao, tốc độ đọc nhanh đến 80MB/s<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Tiêu chuẩn Thẻ Nhớ sử dụng camera tối thiểu là Flash 10 và tốc\r\nđộ ghi đọc 80M/S. Nếu không đạt tiêu chuẩn trên thì không nên sử dụng cho\r\nCamera.Thẻ nhớ DSS 64G 80MB/S thiết kế chịu được các điều kiện thời tiết khắc\r\nnghiệt. Bên cạnh đó, thẻ nhớ còn tuân thủ các tiêu chuẩn nghiêm ngặt trong việc\r\nchống sốc, chống rung, tính ổn định cao. Đồng thời, trọng lượng cực nhẹ và\r\nvô cùng nhỏ gọn, bạn có thể mang theo thẻ nhớ và sử dụng ngay khi cần. Thẻ cung\r\ncấp thêm 32GB dữ liệu cho điện thoại, máy tính bảng có hỗ trợ khe thẻ cắm\r\nmicroSD. Bạn có thể thưởng thức thoải mái các bộ phim, bài hát mà bạn yêu thích.<o:p></o:p></p>', 200000, 320000, 250000, 20, 0, '2021-03-23 17:07:29', '2021-03-23 17:07:29', 'Thẻ Nhớ MicroSD 64Gb DSS Class 10 Up To 80Mb/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ Nhớ MicroSD 64Gb DSS Class 10 Up To 80Mb/s', 'Thẻ Nhớ MicroSD 64Gb DSS Class 10 Up To 80Mb/s'),
(186, 3, '25', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s', 'pktn006', '/assets/uploads/products/1616544619_sub_pktn006.3.jpg', '<p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra với dung lượng lên tới 16GB,\r\nvì vậy bạn sẽ có rất nhiều không gian để lưu trữ hình ảnh và video của bạn. Và\r\nbạn cũng sẽ không cần phải quan tâm đến việc xóa bất kỳ dữ liệu nào khi vấn đề\r\nvề không gian lưu trữ đã không còn quan trọng.<o:p></o:p></p><p class=\"MsoNormal\">Với tốc độ cực nhanh lên đến 80 MB/s, thẻ nhớ MicroSD\r\nSandisk Ultra có thể nhanh chóng di chuyển tất cả hình ảnh và video của bạn từ\r\nđiện thoại hoặc máy tính bảng của bạn để máy tính.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra với tốc độ cao, cho phép bạn\r\nchụp ảnh chất lượng cao và quay video Full HD rất mượt mà.<o:p></o:p></p>', 100000, 200000, 140000, 20, 0, '2021-03-23 17:10:19', '2021-03-23 17:10:19', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s', 'Thẻ nhớ MicroSDHC SanDisk Ultra 16GB 80MB/s'),
(187, 3, '25', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 98MB/s', 'pktn007', '/assets/uploads/products/1616544882_sub_pktn007.3.jpg', '<p class=\"MsoNormal\">Thẻ nhớ MicroSD SanDisk Ultra microSDXC ™ UHS-I hoàn hảo cho\r\nviệc ghi và xem video Full HD, với nhiều giờ video hơn. <o:p></o:p></p><p class=\"MsoNormal\">Tốc độ truyền lên đến 100MB/s (chỉ 64GB-400GB) đảm bảo rằng\r\nbạn có thể di chuyển tất cả nội dung của mình nhanh chóng đến 1200 bức ảnh chỉ\r\ntrong một phút.&nbsp; Lý tưởng cho điện thoại\r\nthông minh và máy tính bảng dựa trên Android ™, xếp hạng A1 của thẻ này có\r\nnghĩa là bạn cũng có thể tải ứng dụng nhanh hơn. <o:p></o:p></p><p class=\"MsoNormal\">Thẻ nhớ MicroSD SanDisk Ultra với dung lượng đột phá lên đến\r\n400GB , bạn có thể lưu trữ nhiều giờ video Full HD&nbsp; trên thẻ mà không phải lo lắng về việc không\r\ncòn chỗ cho video, ảnh, nhạc, phim và các tập tin khác mà bạn muốn quay, lưu và\r\nchia sẻ.<o:p></o:p></p><p class=\"MsoNormal\">Tốc độ truyền tải dữ dội có nghĩa là nội dung của bạn di\r\nchuyển nhanh cho phép bạn di chuyển lên đến 1200 bức ảnh trong một phút.<o:p></o:p></p><p class=\"MsoNormal\">Xếp hạng A1, thẻ microSD ™ SanDisk Ultra® được tối ưu hóa\r\ncho các ứng dụng, cung cấp khởi chạy và hiệu suất ứng dụng nhanh hơn mang lại\r\ntrải nghiệm smartphone tốt hơn.<o:p></o:p></p><p class=\"MsoNormal\">Thẻ nhớ MicroSD SanDisk Ultra cho phép bạn dễ dàng lưu trữ\r\nvideo Full HD và ảnh chất lượng cao.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Thẻ nhớ SanDisk Ultra có thể tương thích với điện thoại\r\nthông minh và máy tính bảng Android.<o:p></o:p></p>', 180000, 290000, 230000, 20, 0, '2021-03-23 17:14:42', '2021-03-23 17:14:42', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 98MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 98MB/s', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 98MB/s'),
(188, 3, '25', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 100MB/s', 'pktn007', '/assets/uploads/products/1616545142_sub_pktn007.3.jpg', '<p><span style=\"font-size: 0.875rem;\">Thẻ nhớ MicroSD Sandisk Ultra với dung lượng lên tới 32GB,\r\nvì vậy bạn sẽ có rất nhiều không gian để lưu trữ hình ảnh và video của bạn. Và\r\nbạn cũng sẽ không cần phải quan tâm đến việc xóa bất kỳ dữ liệu nào khi vấn đề\r\nvề không gian lưu trữ đã không còn quan trọng.</span><br></p><p class=\"MsoNormal\"><o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Với tốc độ cực nhanh lên đến 100 MB/s, thẻ nhớ MicroSD\r\nSandisk Ultra có thể nhanh chóng di chuyển tất cả hình ảnh và video của bạn từ\r\nđiện thoại hoặc máy tính bảng của bạn để máy tính.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra với tốc độ cao, cho phép bạn\r\nchụp ảnh chất lượng cao và quay video Full HD rất mượt mà.<o:p></o:p></p><p><br></p>', 150000, 250000, 180000, 20, 0, '2021-03-23 17:19:02', '2021-03-23 17:19:02', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 100MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 100MB/s', 'Thẻ nhớ MicroSDHC SanDisk Ultra 32GB 100MB/s');
