(189, 3, '25', 'Thẻ Nhớ MicroSDXC SanDisk Ultra 64GB 100MB/s', 'pktn009', '/assets/uploads/products/1616549073_sub_pktn007.1.jpg', '<p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra với dung lượng lên tới 128GB,\r\nvì vậy bạn sẽ có rất nhiều không gian để lưu trữ hình ảnh và video của bạn. Và\r\nbạn cũng sẽ không cần phải quan tâm đến việc xóa bất kỳ dữ liệu nào khi vấn đề\r\nvề không gian lưu trữ đã không còn quan trọng.<o:p></o:p></p><p class=\"MsoNormal\">Với tốc độ cực nhanh lên đến 100MB/s, thẻ nhớ MicroSD\r\nSandisk Ultra có thể nhanh chóng di chuyển tất cả hình ảnh và video của bạn từ\r\nđiện thoại hoặc máy tính bảng của bạn để máy tính.<o:p></o:p></p><p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra với tốc độ cao, cho phép bạn\r\nchụp ảnh chất lượng cao và quay video Full HD rất mượt mà.<o:p></o:p></p><p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra có thể chống nước, nhiệt độ,\r\nchống sock, chống tia X-ray, giữ cho dữ liệu của bạn an toàn.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Với dung lượng lên đến 128 GB. Thẻ nhớ MicroSD Sandisk Ultra\r\ncung cấp cho bạn rất nhiều dung lượng để lưu trữ hình ảnh, nhạc, video và các tập\r\ntin khác.<o:p></o:p></p>', 200000, 350000, 270000, 20, 0, '2021-03-23 18:24:33', '2021-03-23 18:25:08', 'Thẻ Nhớ MicroSDXC SanDisk Ultra 64GB 100MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ Nhớ MicroSDXC SanDisk Ultra 64GB 100MB/s', 'Thẻ Nhớ MicroSDXC SanDisk Ultra 64GB 100MB/s'),
(190, 3, '25', 'Thẻ nhớ SDHC SanDisk Extreme 16GB 90MBs', 'pktn010', '/assets/uploads/products/1616549423_sub_pktn010.3.jpg', '<p class=\"MsoNormal\">Thẻ Nhớ SDHC Extreme SanDisk 16GB 90MB/s là một sản phẩm chất\r\nlượng cao, giúp bạn có thể chụp và lưu ảnh một cách dễ dàng, nhanh chóng, tốc độ\r\nnhanh gấp nhiều lần so với thẻ nhớ thông thường. Sản phẩm chính là một sự lựa\r\nchọn hoàn hảo khi bạn muốn chụp các chuyển động nhanh hoặc để chụp ảnh ở chế độ\r\nliên tục.<o:p></o:p></p><p class=\"MsoNormal\">Với dung lượng 16GB, bạn có thể lưu trữ hàng ngàn bức ảnh và\r\nhàng trăm đoạn video HD. Thẻ Nhớ SDHC Extreme SanDisk 16GB 90MB/sẽ giúp bạn\r\nnâng cao hiệu suất làm việc và mang lại những trải nghiệm hấp dẫn hơn.<o:p></o:p></p><p class=\"MsoNormal\">Thẻ sở hữu tốc độ ấn tượng lên đến 90MB/s giúp bạn ghi đọc dữ\r\nliệu nhanh hơn so với các dòng sản phẩm khác. Kết hợp thẻ với các chế độ chụp\r\nliên tục và nhiều khung hình mỗi giây, bạn sẽ có được những bức ảnh đẹp nhất.\r\nThêm vào đó, bạn sẽ tiết kiệm thời gian sao chép tất cả từ máy ảnh vào máy tính\r\ncủa bạn.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Sản phẩm thiết kế chịu được các điều kiện thời tiết khắc\r\nnghiệt giúp bạn an tâm sử dụng trong hầu như mọi điều kiện thời tiết ở\r\nnhiều vùng địa lý khác nhau. Bên cạnh đó, thẻ nhớ còn tuân thủ các tiêu chuẩn\r\nnghiêm ngặt trong việc chống sốc, chống rung, tính ổn định cao.<o:p></o:p></p>', 170000, 270000, 220000, 20, 0, '2021-03-23 18:30:23', '2021-03-23 18:30:23', 'Thẻ nhớ SDHC SanDisk Extreme 16GB 90MBs, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ SDHC SanDisk Extreme 16GB 90MBs', 'Thẻ nhớ SDHC SanDisk Extreme 16GB 90MBs'),
(191, 3, '25', 'Thẻ nhớ SDHC SanDisk Ultra 320x 16GB Class 10 UHS-I 48MB/s', 'pktn011', '/assets/uploads/products/1616549642_sub_pktn011.2.jpg', '<p><span style=\"font-size: 0.875rem;\">Thẻ nhớ MicroSD Sandisk Ultra với dung lượng lên tới 16GB,\r\nvì vậy bạn sẽ có rất nhiều không gian để lưu trữ hình ảnh và video của bạn. Và\r\nbạn cũng sẽ không cần phải quan tâm đến việc xóa bất kỳ dữ liệu nào khi vấn đề\r\nvề không gian lưu trữ đã không còn quan trọng.</span><br></p><p class=\"MsoNormal\"><o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Với tốc độ cực nhanh lên đến 80 MB/s, thẻ nhớ MicroSD\r\nSandisk Ultra có thể nhanh chóng di chuyển tất cả hình ảnh và video của bạn từ\r\nđiện thoại hoặc máy tính bảng của bạn để máy tính.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Thẻ nhớ MicroSD Sandisk Ultra với tốc độ cao, cho phép bạn\r\nchụp ảnh chất lượng cao và quay video Full HD rất mượt mà.<o:p></o:p></p><p><br></p>', 120000, 250000, 160000, 20, 0, '2021-03-23 18:34:02', '2021-03-23 18:34:02', 'Thẻ nhớ SDHC SanDisk Ultra 320x 16GB Class 10 UHS-I 48MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ SDHC SanDisk Ultra 320x 16GB Class 10 UHS-I 48MB/s', 'Thẻ nhớ SDHC SanDisk Ultra 320x 16GB Class 10 UHS-I 48MB/s'),
(192, 3, '25', 'Thẻ nhớ SDHC SanDisk Ultra 320x 32GB Class 10 UHS-I 48MB/s', 'pktn012', '/assets/uploads/products/1616549789_sub_pktn012.3.jpg', '<p class=\"MsoNormal\">Thẻ nhớ SD Sandisk Ultra 48MB/Thẻ nhớ SD Sandisk Ultra\r\n48MB/s<o:p></o:p></p><p class=\"MsoNormal\">Thẻ nhớ SD Sandisk Ultra 48MB/s UHS-I cho phép bạn chụp ảnh\r\nhoặc quay video mà không bị trễ hoặc mất khung hình trên máy DSLR hay máy quay\r\nphim. Với tốc độ cực kỳ nhanh chóng, hiệu năng đáng tin cậy khi chụp ảnh chất\r\nlượng chuyên nghiệp hoặc quay Video Full HD.<o:p></o:p></p><p class=\"MsoNormal\">Sản phẩm thẻ nhớ SD Sandisk Ultra 48MB/s UHS-I được thiết kế\r\nvới tiêu chuẩn cao nhất và thử nghiệm trong các mô trường khắc nghiệt nhất, vì\r\nvậy bạn có thể tự tin vào chất lượng vượt trội, hiệu suất và độ tin cậy của mỗi\r\nsản phẩm SanDisk. UHS-I cho phép bạn chụp ảnh hoặc quay video mà không bị trễ\r\nhoặc mất khung hình trên máy DSLR hay máy quay phim. Với tốc độ cực kỳ nhanh\r\nchóng, hiệu năng đáng tin cậy khi chụp ảnh chất lượng chuyên nghiệp hoặc quay\r\nVideo Full HD.<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Sản phẩm thẻ nhớ SD Sandisk Ultra 48MB/s UHS-I được thiết kế\r\nvới tiêu chuẩn cao nhất và thử nghiệm trong các mô trường khắc nghiệt nhất, vì\r\nvậy bạn có thể tự tin vào chất lượng vượt trội, hiệu suất và độ tin cậy của mỗi\r\nsản phẩm SanDisk.<o:p></o:p></p>', 150000, 250000, 220000, 20, 0, '2021-03-23 18:36:29', '2021-03-23 19:17:16', 'Thẻ nhớ SDHC SanDisk Ultra 320x 32GB Class 10 UHS-I 48MB/s, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'Thẻ nhớ, phụ kiện', 'Thẻ nhớ SDHC SanDisk Ultra 320x 32GB Class 10 UHS-I 48MB/s', 'Thẻ nhớ SDHC SanDisk Ultra 320x 32GB Class 10 UHS-I 48MB/s'),
(193, 3, '31', 'Chuột không dây Forter V181', 'pkocs001', '/assets/uploads/products/1616634248_sub_pkocs001.2.jpg,/assets/uploads/products/1616634248_sub_pkocs001.4.jpg,/assets/uploads/products/1616634248_sub_pkocs001.5.jpg', '<p><b style=\"font-size: 0.875rem;\">CHUỘT KHÔNG DÂY FORTER V181 MÀU ĐEN - THOẢI MÁI KHI SỬ DỤNG</b><br></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột vi tính là phụ kiện không thể thiếu cho cuộc sống công\r\nnghệ hiện nay. Với chất liệu nhựa khá bền và đẹp tạo vẻ ngoài luôn sáng bóng, chuột\r\nkhông dây Forter V181 màu đen không những chất lượng mà bạn có thể mang di chuyển\r\nđể sử dụng bất cứ nơi nào, bất cứ lúc nào để phục vụ nhu cầu làm việc, vui chơi\r\nvà giải trí.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i>Công nghệ kết nối không dây tốc độ cao<o:p></o:p></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Sử dụng pin AA thông dụng, tiết kiệm pin tối ưu<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Khoảng cách hoạt động 10m<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Thiết kế vừa vặn, hiện đại<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i>Khoảng cách hoạt động <o:p></o:p></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột không dây Forter V181 màu đen được thiết kế để có thể\r\nhoạt động ở khoảng cách xa 10m mà không bị nhiễu sóng, giúp người dùng có thể\r\nhoạt động tự do thoải mái.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i>Thiết kế gọn nhẹ<o:p></o:p></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Với mẫu mã trẻ trung hiện đại, gọn gàng vừa tay, chuột không\r\ndây Forter V181 màu đen hỗ trợ cho người dùng chuột thời gian dài, không bị đau\r\nmỏi các khớp cổ tay.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i>Tiết kiệm năng lượng<o:p></o:p></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột không dây Forter V181 màu đen sử dụng pin AA thông dụng.\r\nCông nghệ tiên tiến tự động tắt bật khi kết nối hoặc shutdown máy tính tiết kiệm\r\ntối đa năng lượng.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i>Công nghệ chuột quang tiên tiến<o:p></o:p></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Với mắt quang học có độ phân giải 1250dpi lên 1800dpi, chuột\r\nkhông dây Forter V181 màu đen giúp bạn di chuyển chính xác, điều hướng trỏ một\r\ncách hiệu quả.<o:p></o:p></p><p><br></p>', 75000, 120000, 90000, 20, 0, '2021-03-24 18:04:08', '2021-05-17 08:06:26', 'Chuột không dây Forter V181, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột không dây, chuột wireless, phụ kiện', 'Chuột không dây Forter V181', 'Chuột không dây Forter V181'),
(194, 3, '31', 'Chuột không dây X-TECH M7073', 'pkc005', '/assets/uploads/products/1616638566_sub_pkc005.2.jpg', '<p><b style=\"font-size: 0.875rem;\"><i><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;\r\nline-height:150%\">Thiết kế vừa vặn</span></i></b><br></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột Không Dây Xtech M7073 mang thiết kế truyền thống với\r\nmàu đen sang trọng và cho cảm giác cầm tay vừa vặn, thoải mái trong việc di\r\nchuyển cũng như hỗ trợ các chức năng giảng dạy, học tập và làm việc.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;\r\nline-height:150%\">Độ phân giải lên đến 1200DPI<o:p></o:p></span></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột được trang bị công nghệ chuột quang tiên tiến cho độ\r\nphân giải lên đến 1200DPI. Độ phân giải cao giúp chuột có thể di chuyển nhanh\r\nvà mượt mà trên nhiều bền mặt, đảm bảo hiệu quả cho công việc, học tập cũng như\r\ngiải trí.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;\r\nline-height:150%\">Công nghệ không dây 2.4GHz tiến tiến<o:p></o:p></span></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột được trang bị công nghệ kết nối không dây tiên tiến\r\n2.4GHz có độ tin cậy cao. Công nghệ này đảm bảo kết nối liên tục giữa chuột và\r\nmáy tính, cho phép dữ liệu được truyền tải chính xác, không bị gián đoạn và\r\nnhanh hơn 60% so với công nghệ cũ trước đây.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\"><b><i><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;\r\nline-height:150%\">Thời gian sử dụng pin lâu<o:p></o:p></span></i></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Chuột sử dụng nguồn năng lượng từ pin AA cùng công nghệ\r\nquang ẩn giúp kéo dài tuổi thọ pin. Chuột có thể hoạt động liên tục lên đến 12\r\ntháng, giúp bạn tiết kiệm chi phí hơn và không còn lo lắng công việc bị gián đoạn\r\ngiữa chừng.<o:p></o:p></p><p><br></p>', 80000, 160000, 110000, 20, 0, '2021-03-24 19:16:06', '2021-05-17 08:06:52', 'Chuột không dây X-TECH M7073, hàng chính hãng, giá rẻ Đà Lạt. Linh kiện phụ kiện PC. Giao hàng nhanh chóng toàn quốc. Bảo hành 1 năm 1 đổi 1 (nếu lỗi).', 'chuột, chuột không dây, chuột wireless, phụ kiện', 'Chuột không dây X-TECH M7073', 'Chuột không dây X-TECH M7073'),
