(198, 1, '5', 'IPhone 8 Plus 64 GB', 'IP8P', '/assets/uploads/products/1621590321_sub_IP8P.IP8PP.png', '<h1><span style=\"color: rgb(104, 113, 136); font-family: Nunito, sans-serif; font-size: 16px; font-weight: 700;\">MNS center chuyên cung cấp các dòng điện thoại IPhone tại Đà Lạt</span></h1><p><span style=\"color: rgb(104, 113, 136); font-family: Nunito, sans-serif; font-size: 16px;\"><b><u>Những điểm nổi bật của dòng điện thoại IPhone 8 Plus</u></b></span></p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\">Loại bỏ thiết kế kim loại nguyên khối: Thay vào đó Apple mang lên mình cho iphone 8 một diện mạo thiết kế mới, hiện đại với mặt lưng được thay bằng kính cường lực tôn lên vẻ sang trọng.</p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><img src=\"https://mnscenter.com/assets/uploads/products/desc/1621755951_desc_ip8PMatlung.png\" style=\"width: 50%;\"><br></p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\">Sạc không dây: Iphone 8 Plus là chiếc điện thoại đầu tiên được tích hợp sạc không dây.&nbsp;</p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><img src=\"https://mnscenter.com/assets/uploads/products/desc/1621504933_desc_ip8%20sac%20ko%20day.png\" style=\"width: 50%;\"><br></p><div><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\">Nếu Bạn thích sản phẩm sạc không dây thì chẳng cần phải tìm đâu cho xa cả, tại MNS center cũng có nhé!</p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\">Link Sản Phẩm:&nbsp;https://mnscenter.com/shop-list-cateLv2/30</p></div><p><br></p>', NULL, 650