(199, 1, '5', 'IPhone X 64 GB', 'IPX', '/assets/uploads/products/1621757814_sub_IPX.ipxW.png', '<h1 style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">MNS center chuyên cung cấp các dòng điện thoại IPhone tại Đà Lạt</span></h1><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><u><b>Những điểm nổi bật của dòng điện thoại IPhone X</b></u></p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\">Thiết kế mang tính đột phá: Apple đã đổi mới thiết kế của mình, không còn giữ thiết kế của các dòng đời cũ 6, 7, 8. Với thiết kế tai thỏ và tỉ lệ màn hình 19.5 : 9 mới mẻ với phần hiển thị mặt trước cực lớn.</p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><img src=\"https://mnscenter.com/assets/uploads/products/desc/1621759799_desc_ipXtaitho.png\" style=\"width: 50%;\"><br></p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\">Bảo mật: Face ID tạo nên đột phá mới của Apple,&nbsp;Với sự trợ giúp của cụm camera TrueDept thì iPhone X có khả năng nhận diện khuôn mặt 3D của người dùng từ đó mở khóa chiếc iPhone một cách nhanh chóng.</p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><img src=\"https://mnscenter.com/assets/uploads/products/desc/1621759966_desc_IPx Face ID.png\" style=\"width: 50%;\"><br></p><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\">Tuy thiết kế có phần mới mẻ nhưng khi Apple loại bỏ nút home thì có nhiều Fan của \"Táo Khuyết\" cảm thấy hơi hụt hẫn.</p>', NULL, 9000000, 850000