(201, 1, '5', 'IPhone XR 64 GB', 'IPXR', '/assets/uploads/products/1621764867_sub_IPXR.ipxrW.png', '<h1 style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">MNS center chuyên cung cấp các dòng điện thoại IPhone tại Đà Lạt</span></h1><p style=\"margin-bottom: 25px; color: rgb(104, 113, 136); line-height: 28px; font-family: Nunito, sans-serif; font-size: 16px;\"><u><b>Những điểm nổi bật của dòng điện thoại IPhone XR</b></u></p><p style=\"margin-bottom: 25px; line-height: 28px;\"><font color=\"#687188\" face=\"Nunito, sans-serif\"><span style=\"font-size: 16px;\">Thiết kế cao cấp và nhiều màu sắc:&nbsp;Apple đã mang tới một sản phẩm vừa giữ lại được sự cao cấp, vừa có nhiều màu sắc trẻ trung. IPhone XR sở hữu hai mặt lưng kính cường lực bền bỉ và được bao quanh bởi khung viền nhôm, tạo cảm giác trên tay rất chắc chắn. Chiếc điện thoại này sở hữu những màu sắc phù hợp với cá tính của từng người dùng. Bên cạnh màu đen và trắng, Apple đã bổ sung thêm màu cam san hô, xanh dương, vàng và đỏ.</span></font></p><p style=\"margin-bottom: 25px; line-height: 28px;\"><img src=\"https://mnscenter.com/assets/uploads/products/desc/1621764593_desc_ipxrfull.png\" style=\"width: 50%;\"><font color=\"#687188\" face=\"Nunito, sans-serif\"><span style=\"font-size: 16px;\"><br></span></font></p><p style=\"margin-bottom: 25px; line-height: 28px;\"><font color=\"#687188\" face=\"Nunito, sans-serif\"><span style=\"font-size: 16px;\"><br></span></font>Apple A12 Bionic:&nbsp; iPhone XR được trang bị con chip A12 Bionic c<span style=\"font-size: 0.875rem;\">on chip thông minh và mạnh mẽ nhất</span><span style=\"font-size: 0.875rem;\">&nbsp;, cho phép bạn chơi mọi tựa game ở cấu hình cao nhất một cách nhẹ nhàng và mượt mà.</span></p><p style=\"margin-bottom: 25px; line-height: 28px;\"><img src=\"https://mnscenter.com/assets/uploads/products/desc/1621764793_desc_test game.png\" style=\"wid